INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('9ff59675-ef6c-440a-aa14-03ed1c180143', 140, 'https://pictures.betaseries.com/films/affiches/original/152.jpg', NULL, 'En 1947, Andy Dufresne, un jeune banquier, est condamné à la prison à vie pour le meurtre de sa femme et de son amant. Ayant beau clamer son innocence, il est emprisonné à Shawshank, le pénitencier le plus sévère de l''État du Maine. Il y fait la rencontre de Red, un noir désabusé, détenu depuis vingt ans. Commence alors une grande histoire d''amitié entre les deux hommes…', 1995, NULL, 'Les Évadés', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ad30fe1c-6531-48ba-ac1d-9a8a2d12046f', 175, 'https://pictures.betaseries.com/films/affiches/original/143.jpg', NULL, 'La Seconde Guerre mondiale vient de s''achever. À New York, le « parrain » Don Corleone, l''un des chefs respectés de la mafia, se sent vieillir. Il refuse de s''adapter à son temps et de se lancer, comme ses pairs, dans le trafic de drogue. Une frilosité qui entrave la bonne marche des affaires des autres « familles » et qui lui vaut d''être la cible d''un attentat. Don Corleone survit à ses blessures, mais reste très diminué. Mike, son plus jeune fils, qui jusque-là se tenait à l''écart des affaires de son père, devient le plus dévoué de ses héritiers. Plus efficace que ses frères, Sonny et Fredo, il venge son père et organise l''élimination de ses adversaires…', 1972, NULL, 'Le Parrain', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('86966220-928d-476a-b53c-1274068e52ee', 202, 'https://pictures.betaseries.com/films/affiches/original/177.jpg', NULL, 'Depuis la mort de Don Vito Corleone, son fils Michael règne sur la famille. Amené à négocier avec la mafia juive, il perd alors le soutien d''un de ses lieutenants, Frankie Pentageli. Echappant de justesse à un attentat, Michael tente de retrouver le coupable, soupçonnant Hyman Roth, le chef de la mafia juive. Vito Corleone, immigrant italien, arrive à New York au début du siècle ; très vite, il devient un des caïds du quartier, utilisant la violence comme moyen de régler toutes les affaires. Seul au départ, il bâtit peu à peu un véritable empire, origine de la fortune de la famille des Corleone.', 1975, NULL, 'Le Parrain, 2e partie', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('9eb3274e-1be5-4e92-b2cd-c64325aced94', 195, 'https://pictures.betaseries.com/films/affiches/original/140.jpg', NULL, 'Évocation des années de guerre d’Oskar Schindler, fils d’industriel d’origine autrichienne rentré à Cracovie en 1939 avec les troupes allemandes. Il va, tout au long de la guerre, protéger des juifs en les faisant travailler dans sa fabrique et en 1944 sauver 800 hommes et 300 femmes du camp d’extermination d’Auschwitz‐Birkenau.', 1994, NULL, 'La Liste de Schindler', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('08b47a0c-d1ba-4611-8eed-ab115cad3a54', 95, 'https://pictures.betaseries.com/films/affiches/original/170.jpg', NULL, 'Un jeune homme d''origine modeste est accusé du meurtre de son père et risque la peine de mort. Le jury composé de douze hommes se retire pour délibérer et procède immédiatement à un vote : onze votent coupable, or la décision doit être prise à l''unanimité. Le juré qui a voté non-coupable, sommé de se justifier, explique qu''il a un doute et que la vie d''un homme mérite quelques heures de discussion. Il s''emploie alors à les convaincre un par un.', 1957, NULL, '12 Hommes en colère', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a1a14b73-78be-489a-92af-c238c18ad656', 180, 'https://pictures.betaseries.com/films/affiches/original/2910.jpg', NULL, 'Chaudhry Baldev Singh est un père de famille installé à Londres. Un jour, il reçoit une lettre d''Inde : son meilleur ami lui écrit, lui rappellant la promesse qu''il avait faite deux décennies auparavant de marier leurs enfants. Chaudhry décide alors de tenir sa promesse, mais donne toutefois un mois libre à sa fille tout avant qu''elle ne s''en aille en Inde se marier...', 1995, NULL, 'Dilwale Dulhania Le Jayenge', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ea018851-0fb7-464c-b2da-dc8855f697ed', 126, 'https://pictures.betaseries.com/films/affiches/original/221.jpg', NULL, 'Chihiro, 10 ans, a tout d’une petite fille capricieuse. Elle s’apprête à emménager avec ses parents dans une nouvelle demeure. Sur la route, la petite famille se retrouve face à un immense bâtiment rouge au centre duquel s’ouvre un long tunnel. De l’autre côté du passage se dresse une ville fantôme. Les parents découvrent dans un restaurant désert de nombreux mets succulents et ne tardent pas à se jeter dessus. Ils se retrouvent alors transformés en cochons. Prise de panique, Chihiro s’enfuit et se dématérialise progressivement. L’énigmatique Haku se charge de lui expliquer le fonctionnement de l’univers dans lequel elle vient de pénétrer. Pour sauver ses parents, la fillette va devoir faire face à la terrible sorcière Yubaba, qui arbore les traits d’une harpie méphistophélique.', 2002, NULL, 'Le Voyage de Chihiro', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c881eb44-d7a3-4811-b861-c9d57cbc8701', 152, 'https://pictures.betaseries.com/films/affiches/original/139.jpg', NULL, 'Batman aborde une phase décisive de sa guerre contre le crime à Gotham City. Avec l''aide du lieutenant de police Jim Gordon et du nouveau procureur Harvey Dent, il entreprend de démanteler les dernières organisations criminelles qui infestent les rues de la ville. L''association s''avère efficace, mais le trio se heurte bientôt à un nouveau génie du crime qui répand la terreur et le chaos dans Gotham : le Joker. On ne sait pas d''où il vient ni qui il est. Ce criminel possède une intelligence redoutable doublé d''un humour sordide et n''hésite pas à s''attaquer à la pègre locale dans le seul but de semer le chaos.', 2008, NULL, 'The Dark Knight : Le Chevalier noir', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('dea3c3e4-5a08-4142-8532-bf3161926079', 135, 'https://pictures.betaseries.com/films/affiches/original/68903.jpg', NULL, 'Toute la famille de Ki-taek est au chômage. Elle s’intéresse particulièrement au train de vie de la richissime famille Park. Mais un incident se produit et les deux familles se retrouvent mêlées, sans le savoir, à une bien étrange histoire…', 2019, NULL, 'Parasite', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ed070a9a-050f-42ee-92ae-293857c6ecdf', 189, 'https://pictures.betaseries.com/films/affiches/original/138.jpg', NULL, 'Paul Edgecomb, pensionnaire centenaire d’une maison de retraite, est hanté par ses souvenirs. Gardien-chef du pénitencier de Cold Mountain en 1935, il était chargé de veiller au bon déroulement des exécutions des peines capitales, en s’efforçant d’adoucir les derniers moments des condamnés. Parmi eux, se trouvait un colosse du nom de John Coffey, accusé du viol et du meurtre de deux fillettes. Intrigué par cet homme candide et timide, aux dons magiques, Edgecomb va tisser avec lui des liens très forts.', 2000, NULL, 'La Ligne verte', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e9a20083-cc64-4c7f-90f9-c27c5e393e5c', 107, 'https://pictures.betaseries.com/films/affiches/original/33202.jpg', NULL, 'Mitsuha est une lycéenne, la fille du maire d''une petite ville nichée entre les montagnes. Vivant avec sa petite sœur et sa grand-mère, c''est une demoiselle franche qui n''hésite pas à dire qu''elle n''a pas envie de participer aux rituels shinto, ou d''aider son père dans ses campagnes électorales. En fait, elle rêve de pouvoir quitter cette ville où elle s''ennuie, pour partir tenter sa chance à la capitale. Taki est un lycéen, un tokyoïte qui travaille à mi-temps dans un restaurant italien, tout en aspirant à des études d''architecture ou dans les Beaux-Arts. Chaque nuit, il fait un rêve étrange, où il devient… une lycéenne campagnarde, vivant dans une petite ville entre les montagnes.  Quel secret se cache derrière ces rêves mutuels, qui unissent ces deux êtres qui ne se sont jamais rencontrés ?', 2016, NULL, 'Your Name.', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('0531f400-dea3-4111-91cd-ae8221976626', 154, 'https://pictures.betaseries.com/films/affiches/original/142.jpg', NULL, 'L’odyssée sanglante et burlesque de petits malfrats dans la jungle d’Hollywood : Deux petits tueurs, un dangereux gangster marié à une camée, un boxeur roublard, des prêteurs sur gages sadiques, un caïd élégant et dévoué, un dealer bon mari et deux tourtereaux à la gâchette facile.', 1994, NULL, 'Pulp Fiction', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('df1a0a47-b8c4-491f-87b9-d59692009918', 201, 'https://pictures.betaseries.com/films/affiches/original/144.jpg', NULL, 'Les armées de Sauron ont attaqué Minas Tirith, la capitale de Gondor. Jamais ce royaume autrefois puissant n''a eu autant besoin de son roi. Mais Aragorn trouvera-t-il en lui la volonté d''accomplir sa destinée ? Tandis que Gandalf tente de soutenir les forces brisées de Gondor, Théoden exhorte les guerriers de Rohan à se joindre au combat.  Mais malgré leur courage et leur loyauté, les armées des Hommes ne sont pas de taille à lutter contre les innombrables légions ennemies qui s''abattent sur la Terre du Milieu... Chaque victoire se paye d''immenses sacrifices. Pendant ce temps et malgré ses pertes, la Communauté poursuit sa quête, ses membres faisant tout pour détourner l''attention de Sauron afin de donner à Frodon une chance d''accomplir sa mission. Voyageant à travers les terres ennemies, ce dernier doit s''appuyer sur Sam et Gollum, tandis que l''Anneau continue de le tenter…', 2003, NULL, 'Le Seigneur des anneaux : Le Retour du roi', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e3a79768-2ae1-4cca-9100-6952fca0e529', 120, 'https://pictures.betaseries.com/films/affiches/original/137.jpg', NULL, 'Durant trois décennies particulièrement agitées, Forrest Gump vit une série d''aventures le propulsant de l''état de handicapé physique à celui de star du football, de héros du Vietnam au roi de la crevette, des honneurs de la Maison Blanche au bonheur d''une grande histoire d''amour. Forrest est le symbole d''une époque, un candide dans une Amérique qui a perdu son innocence. Son cœur dépasse les limites de son QI…', 1994, NULL, 'Forrest Gump', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('bc537f88-8b9c-4136-8f91-a7909108bddf', 161, 'https://pictures.betaseries.com/films/affiches/original/172.jpg', NULL, 'Pendant la guerre de Sécession, Tuco et Joe se lancent à la recherche d''un coffre contenant 200 000 dollars en pièces d''or volés à l''armée sudiste. Ayant des indices complémentaires sur la cache, chacun a besoin de l''autre. Mais un troisième homme entre dans la course : Sentenza, un tueur qui ne recule devant rien pour parvenir à ses fins.', 1968, NULL, 'Le Bon, la Brute et le Truand', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e1373f2a-fbfa-47ec-8213-affc4b5dce7c', 207, 'https://pictures.betaseries.com/films/affiches/original/4097.jpg', NULL, 'Au XVIème siècle, au Japon, des paysans décident d''embaucher des samouraïs pour protéger leur village, et en trouvent sept. Ces hommes organisent la défense du village contre quarante brigands.', 1955, NULL, 'Les Sept Samouraïs', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('23423910-4ddc-4104-ab6e-0ae053696271', 117, 'https://pictures.betaseries.com/films/affiches/original/181.jpg', NULL, 'En 1938, Guido, jeune homme plein de gaieté, rêve d''ouvrir une librairie, malgré les tracasseries de l''administration fasciste. Il tombe amoureux de Dora, institutrice étouffée par le conformisme familial et l''enlève le jour de ses fiançailles avec un bureaucrate du régime. Cinq ans plus tard, Guido et Dora ont un fils : Giosue. Mais les lois raciales sont entrées en vigueur et Guido est juif. Il est alors déporté avec son fils. Par amour pour eux, Dora monte de son plein gré dans le train qui les emmène aux camps de la mort où Guido va tout faire pour éviter l''horreur à son fils…', 1998, NULL, 'La vie est belle', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c1ef6358-fcad-4032-aa97-faa48f67ee53', 125, 'https://pictures.betaseries.com/films/affiches/original/66869.jpg', NULL, 'Taylor Swift offre au monde entier une place au premier rang pour le dernier concert de sa tournée américaine, Taylor Swift reputation Stadium Tour, la tournée la plus vendue de l''histoire des États-Unis.', 2018, NULL, 'Taylor Swift: Reputation Stadium Tour', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e48802a3-d309-4a72-87ac-7ab8d955ff32', 139, 'https://pictures.betaseries.com/films/affiches/original/141.jpg', NULL, 'Le narrateur, sans identité précise, vit seul, travaille seul, dort seul, mange seul ses plateaux‐repas pour une personne comme beaucoup d’autres personnes seules qui connaissent la misère humaine, morale et sexuelle. C’est pourquoi il va devenir membre du Fight club, un lieu clandestin où il va pouvoir retrouver sa virilité, l’échange et la communication. Ce club est dirigé par Tyler Durden, une sorte d’anarchiste entre gourou et philosophe qui prêche l’amour de son prochain.', 1999, NULL, 'Fight Club', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('d5db3b3a-9bf2-4dd1-b1c4-d107e09fc979', 135, 'https://pictures.betaseries.com/films/affiches/original/257.jpg', NULL, 'Dans une favela qui a vu le jour à Rio de Janeiro dans les années soixante, Fusée est un gamin noir, pauvre, trop fragile pour devenir hors-la-loi, mais assez malin pour ne pas se contenter d''un travail sous payé. Il grandit dans un environnement violent, mais tente de voir la réalité autrement, avec l''œil d''un artiste. Il rêve de devenir photographe professionnel. Petit Dé, un enfant de onze ans, emménage dans la Cité. Il souhaite pour sa part devenir le plus grand criminel de Rio et commence son apprentissage en rendant de menus services à la pègre locale. Il admire Tignasse et son gang, qui arraisonnent les camions et cambriolent à tout va. Tignasse donne à Petit Dé l''occasion de commettre un meurtre, le premier d''une longue série…', 2003, NULL, 'La Cité de Dieu', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('fb6edef9-b3d1-42ff-9567-8583ed00fd5e', 109, 'https://pictures.betaseries.com/films/affiches/original/215.jpg', NULL, 'Marion Crane en a assez de ne pouvoir mener sa vie comme elle l''entend. Son travail ne la passionne plus, son amant ne peut l''épouser car il doit verser une énorme pension alimentaire le laissant sans le sou... Mais un beau jour, son patron lui demande de déposer 40 000 dollars à la banque. La tentation est trop grande, et Marion s''enfuit avec l''argent. Très vite la panique commence à se faire sentir. Partagée entre l''angoisse de se faire prendre et l''excitation de mener une nouvelle vie, Marion roule vers une destination qu''elle n''atteindra jamais. La pluie est battante, la jeune femme s''arrête près d''un motel, tenu par un sympathique gérant nommé Norman Bates, mais qui doit supporter le caractère possessif de sa mère. Après un copieux repas avec Norman, Marion prend toutes ses précautions afin de dissimuler l''argent. Pour se délasser de cette journée, elle prend une douche...', 1960, NULL, 'Psychose', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('44aab9d3-3963-4c0c-a92e-47e548a375d8', 122, 'https://pictures.betaseries.com/films/affiches/original/79798.jpg', NULL, 'Exploration intrigante et pécheresse de la séduction, de l''amour interdit et de la rédemption, Gabriel''s Inferno est un récit captivant et follement passionné de la fuite d''un homme de son propre enfer, alors qu''il tente de gagner l''impossible, le pardon et l''amour.', 2020, NULL, 'Gabriel''s Inferno', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('722958f8-1e97-43d2-9aae-8888a256f9a1', 169, 'https://pictures.betaseries.com/films/affiches/original/13142.jpg', NULL, 'Dans un futur proche, face à une Terre exsangue, un groupe d’explorateurs utilise un vaisseau interstellaire pour franchir un trou de ver permettant de parcourir des distances jusque‐là infranchissables. Leur but : trouver un nouveau foyer pour l’humanité.', 2014, NULL, 'Interstellar', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('359e2281-5e26-46ef-a1a1-f8056db54df5', 220, 'https://pictures.betaseries.com/films/affiches/original/174.jpg', NULL, 'A New York, à la fin de la prohibition, Noodles se réfugie dans une fumerie d''opium après un coup qui a mal tourné. Plus de trente ans plus tard, il est de retour en ville et se remémore son passé de gangster : de sa jeunesse de voyou dans les années 20, marquée par sa rencontre avec son ami Max et leurs nombreux trafics dans le ghetto juif de la ville, jusqu''à la période de prohibition où leur bande, liée par une profonde amitié, s''enrichit et marque son ascension dans la pègre grâce au commerce illégal d''alcool. Noodles se rappelle aussi de sa relation amoureuse échouée avec Deborah durant toute sa vie.', 1984, NULL, 'Il était une fois en Amérique', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e6904d46-6e74-4bf1-a027-e00cfe4c15d1', 133, 'https://pictures.betaseries.com/films/affiches/original/166.jpg', NULL, 'Randle P. McMurphy se fait interner pour échapper à la prison. Il va être touché par la détresse et la solitude des patients. Très rapidement, il comprend que l’infirmière en chef, Mlle Ratched, a imposé des règles strictes et entend bien les faire respecter. Il décide alors de révolutionner ce petit monde, plutôt au départ par jeu.', 1976, NULL, 'Vol au-dessus d''un nid de coucou', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('bad2037d-ddc0-47d5-a451-f61e331cec44', 105, 'https://pictures.betaseries.com/films/affiches/original/80774.jpg', NULL, 'Le professeur Gabriel Emerson apprend enfin la vérité sur l''identité de Julia Mitchell, mais il le réalise un moment trop tard. Julia a fini d''attendre que le spécialiste très respecté de Dante se souvienne d''elle et ne veut plus rien avoir à faire avec lui. Gabriel peut-il regagner le cœur de Julia avant qu''elle ne trouve l''amour dans d''autres bras ?', 2020, NULL, 'Gabriel''s Inferno: Part II', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('dcffb827-b290-4894-81ab-566eb4dedf21', 85, 'https://pictures.betaseries.com/films/affiches/original/77330.jpg', NULL, 'L''histoire raconte l''histoire d''un démon chat qui a été ramené à sa forme d''origine par son gardien Zhen Ting parce qu''il a volé la perle de Tianming à l''immortel Laojun. Quand il vivait dans la rue, il a été ramassé par la fille Luo Xiaobai comme chat errant. Lorsque Xiao Hei vivait avec Luo Xiaobai et son frère Agen dans la maison de son grand-père à la campagne, il vécut de merveilleuses aventures et se lia d''amitié.', 2019, NULL, 'L''histoire de Luo Xiaohei', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f85e83e0-4b4a-4519-a5f0-67bf4ae6e038', 179, 'https://pictures.betaseries.com/films/affiches/original/154.jpg', NULL, 'Le jeune et timide Hobbit, Frodon Sacquet, hérite d''un anneau. Bien loin d''être une simple babiole, il s''agit de l''Anneau Unique, un instrument de pouvoir absolu qui permettrait à Sauron, le Seigneur des ténèbres, de régner sur la Terre du Milieu et de réduire en esclavage ses peuples. À moins que Frodon, aidé d''une Compagnie constituée de Hobbits, d''Hommes, d''un Magicien, d''un Nain, et d''un Elfe, ne parvienne à emporter l''Anneau à travers la Terre du Milieu jusqu''à la Crevasse du Destin, lieu où il a été forgé, et à le détruire pour toujours. Un tel périple signifie s''aventurer très loin en Mordor, les terres du Seigneur des ténèbres, où est rassemblée son armée d''Orques maléfiques… La Compagnie doit non seulement combattre les forces extérieures du mal mais aussi les dissensions internes et l''influence corruptrice qu''exerce l''Anneau lui-même.', 2001, NULL, 'Le Seigneur des anneaux : La Communauté de l''anneau', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('8c64db07-6ab3-446e-b33e-d67669ec3fdc', 119, 'https://pictures.betaseries.com/films/affiches/original/283.jpg', NULL, 'La jeune Sophie, âgée de 18 ans, travaille sans relâche dans la boutique de chapelier que tenait son père avant de mourir. Lors de l’une de ses rares sorties en ville, elle fait la connaissance de Hauru le Magicien. Celui‐ci est extrêmement séduisant, mais n’a pas beaucoup de caractère… Se méprenant sur leur relation, une sorcière jette un épouvantable sort sur Sophie et la transforme en vieille femme de 90 ans. Accablée, Sophie s’enfuit et erre dans les terres désolées. Par hasard, elle pénètre dans le Château Ambulant de Hauru et, cachant sa véritable identité, s’y fait engager comme femme de ménage. Cette « vieille dame » aussi mystérieuse que dynamique va bientôt redonner une nouvelle vie à l’ancienne demeure. Plus énergique que jamais, Sophie accomplit des miracles. Quel fabuleux destin l’attend  ? Et si son histoire avec Hauru n’en était qu’à son véritable commencement  ?', 2005, NULL, 'Le Château ambulant', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ff67aea7-aa56-40f0-9347-3844adcce502', 105, 'https://pictures.betaseries.com/films/affiches/original/84908.jpg', NULL, 'La dernière partie de l''adaptation cinématographique du roman d''amour érotique, Gabriel''s Inferno, écrit par un auteur canadien anonyme sous le pseudonyme de Sylvain Reynard.', 2020, NULL, 'Gabriel''s Inferno: Part III', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('d95fed26-61b1-4300-8c07-ff317780ac58', 117, 'https://pictures.betaseries.com/films/affiches/original/26151.jpg', NULL, 'Spider-Man : New Generation suit les aventures de Miles Morales, un adolescent afro-américain et portoricain qui vit à Brooklyn et s’efforce de s’intégrer dans son nouveau collège à Manhattan. Mais la vie de Miles se complique quand il se fait mordre par une araignée radioactive et se découvre des super-pouvoirs : il est désormais capable d’empoisonner ses adversaires, de se camoufler, de coller littéralement aux murs et aux plafonds ; son ouïe est démultipliée... Dans le même temps, le plus redoutable cerveau criminel de la ville, le Caïd, a mis au point un accélérateur de particules nucléaires capable d’ouvrir un portail sur d’autres univers. Son invention va provoquer l’arrivée de plusieurs autres versions de Spider-Man dans le monde de Miles, dont un Peter Parker plus âgé, Spider-Gwen, Spider-Man Noir, Spider-Cochon et Peni Parker, venue d’un dessin animé japonais.', 2018, NULL, 'Spider-Man : New Generation', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('94af428a-68ef-4c4c-9c5d-23097a56984d', 122, 'https://pictures.betaseries.com/films/affiches/original/19815.jpg', NULL, 'Après l’agression sexuelle dont est victime leur petite fille de huit ans, So-won (qui signifie « vœu » en coréen), la vie de Dong-hoon et Mi-hee bascule et les deux parents sombrent peu à peu dans le désespoir.  Mais un jour, So-won fait un vœu dont les conséquences pourraient bien faire renaître l’espoir et aider sa famille à se reconstruire…', 2013, NULL, 'Hope', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('7585f338-d85f-486f-aebf-1be56482d54b', 104, 'https://pictures.betaseries.com/films/affiches/original/29479.jpg', NULL, 'Le quartier animé João Grilo et chico sournoise sont pauvres gars qui vivent dans l''arrière-pays qui trichent un tas de gens dans une petite ville du Nord-Est du Brésil. Mais quand ils meurent, ils doivent être jugés par le Christ, le diable et la Vierge Marie, avant d''être admis au paradis.', 2000, NULL, 'Will A Dog', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('39ffc191-b6ed-43fc-87d6-da44c4314c7b', 180, 'https://pictures.betaseries.com/films/affiches/original/158.jpg', NULL, 'Après la mort de Boromir et la disparition de Gandalf, la Communauté s''est scindée en trois. Perdus dans les collines d''Emyn Muil, Frodon et Sam découvrent qu''ils sont suivis par Gollum, une créature versatile corrompue par l''Anneau. Celui-ci promet de conduire les Hobbits jusqu''à la Porte Noire du Mordor. À travers la Terre du Milieu, Aragorn, Legolas et Gimli font route vers le Rohan, le royaume assiégé de Theoden. Cet ancien grand roi, manipulé par l''espion de Saroumane, le sinistre Langue de Serpent, est désormais tombé sous la coupe du malfaisant magicien. Eowyn, la nièce du Roi, reconnaît en Aragorn un meneur d''hommes. Entretemps, les Hobbits Merry et Pippin, prisonniers des Uruk-hai, se sont échappés et ont découvert dans la mystérieuse Forêt de Fangorn un allié inattendu : Sylvebarbe, gardien des arbres, représentant d''un ancien peuple végétal dont Saroumane a décimé la forêt…', 2002, NULL, 'Le Seigneur des anneaux : Les Deux Tours', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c47bef32-8650-4249-875d-23878dd477de', 126, 'https://pictures.betaseries.com/films/affiches/original/186.jpg', NULL, 'Dans le ghetto juif vit un petit barbier qui ressemble énormément à Adenoid Hynkel, le dictateur de Tomania qui a décidé l''extermination du peuple juif. Au cours d''une rafle, le barbier est arrêté en compagnie de Schultz, un farouche adversaire d''Hynkel…', 1945, NULL, 'Le Dictateur', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f6c1d1a4-e609-4d56-9563-bbbddcd30db0', 140, 'https://pictures.betaseries.com/films/affiches/original/68138.jpg', NULL, 'Violet Evergarden est toujours incapable d''oublier Gilbert, son ancien supérieur hiérarchique. Un jour, alors qu''elle reçoit une demande d''un jeune client, CH Postal découvre une lettre sans adresse dans leur entrepôt.', 2021, NULL, 'Violet Evergarden - le film', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('7b4e8333-399d-434b-bd28-07407325409c', 124, 'https://pictures.betaseries.com/films/affiches/original/169.jpg', NULL, 'Malgré la destruction de l’Étoile Noire, l''Empire maintient son emprise sur la galaxie, et poursuit sans relâche sa lutte contre l''Alliance rebelle. Basés sur la planète glacée de Hoth, les rebelles essuient un assaut des troupes impériales. Parvenus à s''échapper, la princesse Leia, Han Solo, Chewbacca et C-3P0 se dirigent vers Bespin, la cité des nuages gouvernée par Lando Calrissian, ancien compagnon de Han. Suivant les instructions d''Obi-Wan Kenobi, Luke Skywalker se rend quant à lui vers le système de Dagobah, planète marécageuse où il doit recevoir l''enseignement du dernier maître Jedi, Yoda. Apprenant l''arrestation de ses compagnons par les stormtroopers de Dark Vador après la trahison de Lando, Luke décide d''interrompre son entraînement pour porter secours à ses amis et affronter le sombre seigneur Sith...', 1980, NULL, 'L''Empire contre-attaque', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ad797ce2-0d1c-4ad1-9cf7-02d38dd59bc5', 130, 'https://pictures.betaseries.com/films/affiches/original/36066.jpg', NULL, 'Nishimiya est une élève douce et attentionnée. Chaque jour, elle est harcelée par Ishida, car elle est sourde. Dénoncé pour son comportement, le garçon est à son tour mis à l’écart et renvoyé de l’école… Des années plus tard, il apprend la langue des signes… et part à la recherche de la jeune fille.', 2018, NULL, 'Silent Voice', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('d973acdd-4c12-4bac-b033-bb5fea593b57', 149, 'https://pictures.betaseries.com/films/affiches/original/199.jpg', NULL, 'Varsovie, au mois d’octobre 1939. Un jeune pianiste juif, Wladyslaw Szpilman, est enfermé dans le ghetto avec sa famille. Il assiste, impuissant, aux humiliations que subissent quotidiennement les siens. Grâce à une aide extérieure, il échappe de justesse à la déportation mais voit partir toute sa famille. Le jeune homme se cache alors dans les maisons vides et observe passivement les derniers habitants se révolter contre l’occupation allemande. Après avoir réussi à s’échapper miraculeusement, il se terre dans des quartiers détruits et tente de survivre, ce qui s’avère de plus en plus dur. C’est alors qu’il rencontre un nazi mélomane…', 2002, NULL, 'Le Pianiste', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('09f1e2fe-c58f-4781-b2b5-f9518b99fd24', 106, 'https://pictures.betaseries.com/films/affiches/original/18688.jpg', NULL, 'Andrew, 19 ans, rêve de devenir l’un des meilleurs batteurs de jazz de sa génération. Mais la concurrence est rude au conservatoire de Manhattan où il s’entraîne avec acharnement. Il a pour objectif d’intégrer le fleuron des orchestres dirigé par Terence Fletcher, professeur féroce et intraitable. Lorsque celui-ci le repère enfin, Andrew se lance, sous sa direction, dans la quête de l’excellence…', 2014, NULL, 'Whiplash', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('12297ff9-64cc-477b-af59-0d717917954e', 136, 'https://pictures.betaseries.com/films/affiches/original/93360.jpg', NULL, 'Le tuteur adolescent Fuutaro Uesugi doit enfin choisir entre les 5 sœurs Nakano, qui ont toutes des sentiments pour lui, lors du prochain festival culturel de l''école; l''événement qui conduira à son mariage avec l''une d''elles.', 2022, NULL, 'The Quintessential Quintuplets : the Movie', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('38ddb0d0-2b13-4f2d-97aa-b17e1f22d6b7', 130, 'https://pictures.betaseries.com/films/affiches/original/167.jpg', NULL, 'À New York, un criminel anonyme a décidé de commettre 7 meurtres basés sur les 7 pêchés capitaux énoncés dans la Bible : gourmandise, avarice, paresse, orgueil, luxure, envie et colère. Vieux flic blasé à 7 jours de la retraite, l''inspecteur Somerset mène l''enquête tout en formant son remplaçant, l''ambitieux inspecteur David Mills…', 1996, NULL, 'Seven', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('60df01ec-7cae-4bd8-8973-4044b5d2d462', 148, 'https://pictures.betaseries.com/films/affiches/original/6.jpg', NULL, 'Dom Cobb est un voleur expérimenté, le meilleur dans l''art dangereux de l''extraction, voler les secrets les plus intimes enfouis au plus profond du subconscient durant une phase de rêve, lorsque l''esprit est le plus vulnérable. Les capacités de Cobb ont fait des envieux dans le monde tourmenté de l''espionnage industriel alors qu''il devient fugitif en perdant tout ce qu''il a un jour aimé. Une chance de se racheter lui est alors offerte. Une ultime mission grâce à laquelle il pourrait retrouver sa vie passée mais uniquement s''il parvient à accomplir l''impossible inception.', 2010, NULL, 'Inception', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('15178767-3d60-4d7a-a106-d6bb2f5b9c70', 110, 'https://pictures.betaseries.com/films/affiches/original/241.jpg', NULL, 'À cause d''une jambe cassée, le reporter-photographe L. B. Jefferies est contraint de rester chez lui dans un fauteuil roulant. Homme d''action et amateur d''aventures, il s''aperçoit qu''il peut tirer parti de son immobilité forcée en étudiant le comportement des habitants de l''immeuble qu''il occupe dans Greenwich Village. Et ses observations l''amènent à la conviction que Lars Thorwald, son voisin d''en face, a assassiné sa femme. Sa fiancée, Lisa Fremont, ne le prend tout d''abord pas au sérieux, ironisant sur l''excitation que lui procure sa surveillance, mais finit par se prendre au jeu.', 1955, NULL, 'Fenêtre sur cour', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b2e97ef9-6546-4d3c-aafb-21087a4820f9', 45, 'https://pictures.betaseries.com/films/affiches/original/15067.jpg', NULL, 'Perdue dans une forêt à côté de la maison de son grand-père où elle se rend chaque été, la petite Hotaru fait la rencontre d''un garçon mystérieux qui l''aide à retrouver son chemin. Elle commence à lui rendre visite tous les étés et l''esprit attend ces moments partagés avec Hotaru, au risque de disparaître…', 2011, NULL, 'Vers la forêt des lucioles', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('fc2f2fbd-e7f1-4b58-88ef-a2d697a2711b', 118, 'https://pictures.betaseries.com/films/affiches/original/162.jpg', NULL, 'À travers l’histoire d’une famille américaine, ce film tente d’expliquer l’origine du racisme et de l’extrémisme aux États‐Unis. Il raconte l’histoire de Derek qui, voulant venger la mort de son père, abattu par un dealer noir, a épousé les thèses racistes d’un groupuscule de militants d’extrême droite et s’est mis au service de son leader, brutal théoricien prônant la suprématie de la race blanche. Ces théories le mèneront à commettre un double meurtre entrainant son jeune frère, Danny, dans la spirale de la haine.', 1999, NULL, 'American History X', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('737b57af-9a80-4909-b9d6-3ce922fe13ae', 118, 'https://pictures.betaseries.com/films/affiches/original/187.jpg', NULL, 'Un psychopathe connu sous le nom de Buffalo Bill sème la terreur dans le Middle West en kidnappant et en assassinant de jeunes femmes. Clarice Starling, une jeune stagiaire du FBI, est chargée d’interroger l’ex‐psychiatre Hannibal Lecter. Psychopathe redoutablement intelligent et porté sur le cannibalisme, Lecter est capable de lui fournir des informations concernant Buffalo Bill ainsi que son portrait psychologique. Mais il n’accepte de l’aider qu’en échange d’informations sur la vie privée de la jeune femme. Entre eux s’établit un lien de fascination et de répulsion.', 1991, NULL, 'Le Silence des agneaux', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('463cb0e4-e396-40db-95fe-af34b4b1aebf', 135, 'https://pictures.betaseries.com/films/affiches/original/232.jpg', NULL, 'Au XVᵉ siècle, durant l’ère Muromachi, la forêt japonaise, jadis protégée par des animaux géants, se dépeuple à cause de l’homme. Un sanglier transformé en démon dévastateur en sort et attaque le village d’Ashitaka, futur chef du clan Emishi. Touché par le sanglier qu’il a tué, celui‐ci est forcé de partir à la recherche du dieu Cerf pour lever la malédiction qui lui gangrène le bras.', 2000, NULL, 'Princesse Mononoké', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f478a894-8070-46ca-9119-749c03baad75', 107, 'https://pictures.betaseries.com/films/affiches/original/51218.jpg', NULL, 'Un jeune de 17 ans apprend que sa petite-amie n''a plus qu''une année à vivre.', 2020, NULL, 'Life in a Year', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a59a5f91-c73b-4173-ad55-3aecb93a36eb', 82, 'https://pictures.betaseries.com/films/affiches/original/6458.jpg', NULL, '« The End of Evangelion » est un film divisé en deux parties (« Love is Destructive » et « One More Final: I need you ») proposant une conclusion alternative à de la série « Neon Genesis Evangelion ».  Alors que la NERV, le dernier rempart contre les Anges, est assailli par les militaires qui massacrent tout sur leur passage, Asuka mène un combat sans merci contre les neuf EVA. Le monde se prépare à subir le Troisième Impact.', 1997, NULL, 'Neon Genesis Evangelion : The End of Evangelion', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ed9a9292-4ef1-4beb-a736-9f2e0d5a2123', 110, 'https://pictures.betaseries.com/films/affiches/original/190.jpg', NULL, 'Norma Desmond, grande actrice du muet, vit recluse dans sa luxueuse villa de Berverly Hills en compagnie de Max von Meyerling, son majordome qui fut aussi son metteur en scène et mari. Joe Gillis, un scénariste sans le sou, pénètre par hasard dans la propriété et Norma lui propose de travailler au scénario du film qui marquera son retour à l''écran, Salomé. Joe accepte, s''installe chez elle, à la fois fasciné et effrayé par ses extravagances et son délire, et devient bientôt son amant. Quand son délire se transforme en paranoïa et qu''elle débarque au milieu des studios Paramount pour convaincre Cecil B. DeMille de tourner à nouveau avec elle, Gillis commence à prendre ses distances...', 1951, NULL, 'Boulevard du crépuscule', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('2c8a2778-c94b-44ce-b4b5-72caca27475c', 118, 'https://pictures.betaseries.com/films/affiches/original/129349.jpg', NULL, 'Delia se réveille chaque matin avec une gifle de son mari Ivano. Elle se lève, prépare le petit-déjeuner de leurs trois fils, vide l''urinoir de son beau-père alité, puis quitte la maison pour affronter, sans relâche, son quotidien, fait de divers travaux sous-payés (réparer le linge, régler les parapluies, suspendre les draps), utile pour rassembler un peu d’argent qui n’est jamais suffisant. Toute la journée, elle continue de recevoir des gifles de toutes parts. Car Delia n''est pas seulement pauvre, elle est aussi une femme.', 2024, NULL, 'Il reste encore demain', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ec5a77d4-0467-46aa-a8a3-5552c7d29423', 98, 'https://pictures.betaseries.com/films/affiches/original/78480.jpg', NULL, 'Kumiko, paraplégique depuis l’enfance, vit avec sa grand-mère, qui la sur-protège du monde extérieur. Elle sort peu et s’est créé son propre univers, aidée par la lecture, sa fascination pour la mer et son imagination débordante. Elle demande qu’on l’appelle Josée, du nom d''une jeune héroïne d’un roman de Sagan. Tsuneo, brillant étudiant en biologie marine, aimerait poursuivre ses études au Mexique où il pourrait vivre son rêve, plonger dans les eaux tropicales. Pour cela il lui faut de l’argent et il cherche donc des petits boulots. Un soir, il tombe littéralement sur Josée et la sauve d’une horrible chute. Suite à cette rencontre accidentelle, la grand-mère de Josée engage Tsuneo comme aide-soignant. Josée se révèle autoritaire et têtue, mais Tsunéo est d’une grande patience. Ils apprennent à se connaître et même à s’apprécier. Un jour, il emmène Josée à la mer…', 2021, NULL, 'Josée, le tigre et les poissons', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('46f96267-241e-43aa-8ff0-2631ae0ad99d', 116, 'https://pictures.betaseries.com/films/affiches/original/5.jpg', NULL, 'En 1985, Marty, un adolescent comme les autres, mène une existence morne et ennuyeuse. Heureusement, il est épris de la jolie Jennifer et entretient une profonde amitié avec Doc, un savant fou qui prétend avoir inventé une machine à explorer le temps. Un jour, Doc invite Marty à l''essayer…', 1985, NULL, 'Retour vers le futur', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b70bd132-95b4-48ac-b8e8-8c79361cb1f6', 128, 'https://pictures.betaseries.com/films/affiches/original/280.jpg', NULL, 'Todd Anderson est un garçon plutôt timide. Désormais élève de la prestigieuse académie Welton, réputée pour être l''une des plus fermées et austères des États-Unis, tout le monde attend de lui qu''il suive les traces de son frère, qui avait fait à Welton de brillantes études.  C''est là qu''il va faire la rencontre de M. Keating, un professeur de lettres anglaises qui, c''est le moins que l''on puisse dire, sort des sentiers battus. Jour après jour, M. Keating encourage ses élèves à penser par eux-mêmes et à refuser l''ordre établi. Cette rencontre va bouleverser la vie du jeune Todd, mais aussi celle de ses amis.', 1990, NULL, 'Le Cercle des poètes disparus', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('534bb389-0337-4c1c-9357-2d9c22a253a9', 110, 'https://pictures.betaseries.com/films/affiches/original/201.jpg', NULL, 'Léon est un tueur professionnel redoutable et insaisissable. Il vit seul à New York avec sa plante verte et ses habitudes jusqu''au jour où une petite Mathilda de douze ans sonne à sa porte et fait irruption dans sa vie.', 1994, NULL, 'Léon', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ed107910-fe43-4530-aedf-8f7c024d4e81', 143, 'https://pictures.betaseries.com/films/affiches/original/5712.jpg', NULL, 'Atteint d''un cancer, Watanabe, chef de service du génie civil, décide de réaliser le projet qu''il avait tout d''abord repoussé : celui d''assainir un terrain vague du quartier de Hureocho pour que les enfants puissent jouer dans un véritable jardin.', 1966, NULL, 'Vivre', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b832ab5e-2402-40dd-87d1-feba21fbc7d2', 34, 'https://pictures.betaseries.com/films/affiches/original/120449.jpg', NULL, 'Un garçon, une taupe, un renard et un cheval se lient d''amitié et voyagent ensemble, à la recherche d''un foyer pour le garçon.', 2022, NULL, 'L''enfant, la taupe, le renard et le cheval', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3786496c-a4b8-40d9-a665-5c3c784d939b', 143, 'https://pictures.betaseries.com/films/affiches/original/5785.jpg', NULL, 'À Yokohama, un malfaiteur kidnappe un enfant, qu''il prend pour le fils d''un industriel japonais. Il s''agit en fait du fils de son chauffeur. Le commissaire Tokura est chargé de l''affaire.', 1976, NULL, 'Entre le ciel et l''enfer', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('13940808-4a01-4e62-8be0-0f08ba4d6446', 87, 'https://pictures.betaseries.com/films/affiches/original/197.jpg', NULL, 'Charlot est ouvrier dans une gigantesque usine. Il resserre quotidiennement des boulons. Mais les machines, le travail à la chaîne le rendent malade, il abandonne son poste, recueille une orpheline et vit d''expédients. Le vagabond et la jeune fille vont s''allier pour affronter ensemble les difficultés de la vie…', 1936, NULL, 'Les Temps Modernes', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('bed93cd5-89b7-480a-8126-bbb4f24ff2db', 87, 'https://pictures.betaseries.com/films/affiches/original/226.jpg', NULL, 'Un vagabond s’éprend d’une belle et jeune vendeuse de fleurs aveugle qui vit avec sa mère, couverte de dettes. Suite à un quiproquo, la fleuriste s’imagine le misérable, qui vient de lui acheter une fleur, en milliardaire…', 1931, NULL, 'Les Lumières de la ville', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('0064f121-dd85-4ecd-9c3f-aa4243e0d77b', 131, 'https://pictures.betaseries.com/films/affiches/original/15674.jpg', NULL, 'Accusé de tentative de meurtre sur la personne de sa femme, Claude Gaspard est enfermé à la prison de la Santé. Ses quatre compagnons de cellule lui font part de leur désir d''évasion et creusent, avec une énergie farouche, un tunnel qui les mènera à la liberté. Leur plan aboutira-t-il ?', 1960, NULL, 'Le Trou', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f0b9b7e6-9da0-44b7-9719-ba9b92a05d82', 81, 'https://pictures.betaseries.com/films/affiches/original/3027.jpg', NULL, 'Chanteuse pop très populaire, Mima décide d’abandonner la scène pour devenir actrice. Sans regrets, elle quitte son groupe et accepte un petit rôle dans une série TV, déclenchant ainsi la colère de ses fans… et plus particulièrement celle de l’un deux. Le mystérieux « traqueur » passe à l’acte en dévoilant en détail la vie de Mima sur Internet, puis en menaçant ses proches. Des incidents violents se produisent et elle réalise que son existence se confond dangereusement avec la série dans laquelle elle joue. Mima sombre dans la schizophrénie tandis que les cadavres s’accumulent autour d’elle…', 1999, NULL, 'Perfect Blue', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('816ef5a9-4ff0-4598-a874-504385cadae4', 136, 'https://pictures.betaseries.com/films/affiches/original/3066.jpg', NULL, 'Pendant la Seconde Guerre mondiale, Fliora, jeune garçon d''un village de Biélorussie occupé par les troupes nazies, s''engage, bien que trop jeune, chez les partisans. Il va découvrir l''amour, la fraternité, la souffrance, la guerre.', 1987, NULL, 'Requiem pour un massacre', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('4d14bb1c-a66f-46a4-92f2-d3753e938621', 166, 'https://pictures.betaseries.com/films/affiches/original/176.jpg', NULL, 'Alors que les constructeurs de chemins de fer traversent sans relâche le désert de l''Arizona en direction de la mer, Jill arrive dans la petite ville de Flagstone avec l''intention de commencer une nouvelle vie.', 1969, NULL, 'Il était une fois dans l''Ouest', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a1c23ecf-e84d-47ec-a212-57dab809f5df', 153, 'https://pictures.betaseries.com/films/affiches/original/212.jpg', NULL, 'Cloîtré dans une chambre d''hôtel de Saïgon, le jeune capitaine Willard, mal rasé et imbibé d''alcool, est sorti de sa prostration par une convocation de l''état-major américain. Le général Corman lui confie une mission qui doit rester secrète : éliminer le colonel Kurtz, un militaire aux méthodes quelque peu expéditives et qui sévit au-delà de la frontière cambodgienne.', 1979, NULL, 'Apocalypse Now', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e28a4832-ae8f-4c90-924c-4d0e3f4ed979', 112, 'https://pictures.betaseries.com/films/affiches/original/135.jpg', NULL, 'À la suite d’un accident de parapente, Philippe, riche aristocrate, engage comme aide à domicile Driss, un jeune de banlieue tout juste sorti de prison. Bref la personne la moins adaptée pour le job. Ensemble ils vont faire cohabiter Vivaldi et Earth Wind and Fire, le verbe et la vanne, les costumes et les bas de survêtement… Deux univers vont se télescoper, s’apprivoiser, pour donner naissance à une amitié aussi dingue, drôle et forte qu’inattendue, une relation unique qui fera des étincelles et qui les rendra… Intouchables.', 2011, NULL, 'Intouchables', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('4dcbd495-c036-4c0e-a979-552f043cb601', 86, 'https://pictures.betaseries.com/films/affiches/original/211.jpg', NULL, 'En 1916, durant la Première Guerre mondiale, le général français Broulard ordonne au général Mireau de lancer une offensive suicidaire contre une position allemande imprenable, surnommée la « Fourmilière ». Au moment de l''attaque, les soldats tombent par dizaines et leurs compagnons, épuisés, refusent d''avancer…', 1975, NULL, 'Les Sentiers de la gloire', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a025c965-65c4-4944-afae-15498cf670e8', 116, 'https://pictures.betaseries.com/films/affiches/original/66068.jpg', NULL, 'Stella Grant, dix-sept ans, est atteinte par la fibrose kystique. Elle a passé une grande partie de sa vie entre les quatres murs de sa chambre d''hôpital. C''est dans ce contexte, qu''elle tombe amoureuse de Will Newman, également atteint de la mucoviscidose. Leurs états de santé respectifs les empêchent de s''approcher trop près l''un de l''autre. De plus, Stella doit tenter de raisonner son amoureux qui ne veut plus prendre ses traitements médicaux.', 2019, NULL, 'À deux mètres de toi', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('89b1821f-090c-44a5-95e2-9c4d8dc07880', 123, 'https://pictures.betaseries.com/films/affiches/original/21430.jpg', NULL, 'Un homme marche dans le désert. Il observe les insectes, les photographie, les ramasse. S''étant arrêté pour se reposer, il est accosté par trois villageois qui lui proposent de passer la nuit dans leur village.L''homme est escorté jusqu''à une fosse au fond de laquelle une femme l''accueille et lui offre repas et couche. Pendant la nuit, la femme sort et ramasse le sable qui s''écoule des parois. Au petit matin, l''échelle de corde a disparu et l''homme se rend compte qu''il a été fait prisonnier.', 1964, NULL, 'La Femme des sables', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b6639440-4b4b-4c09-afe5-a66d5923df5c', 132, 'https://pictures.betaseries.com/films/affiches/original/72348.jpg', NULL, 'Séparé de sa fille, un père avec un handicap mental doit prouver son innocence lorsqu''il est arrêté pour le meurtre d''une enfant.', 2019, NULL, 'La Cellule Numéro 7', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b0994e2c-05ce-4f31-9708-64ceb1262c1f', 136, 'https://pictures.betaseries.com/films/affiches/original/6023.jpg', NULL, 'Bedford Falls, petite ville de l''État de New York, la veille de Noël. De chaque foyer s''élève une prière. Les paroles murmurées avec ferveur concernent toutes le même homme – George Bailey –, qu''elles proviennent de la bouche de son épouse, de ses enfants, de ses amis et collègues… et de manière générale de tous ceux qui tiennent à lui. Les prières vont être exaucées et Clarence, un ange sans ailes est envoyé au secours de George afin de gagner ses ailes. Avec lui, nous revivons les années écoulées dans la vie de George .Ayant renoncé à son rêve d''enfant de devenir explorateur, pour reprendre la banque de son père, il a toujours consacré son énergie et son argent à l''amélioration des conditions de vie des habitants de la ville, en luttant contre le désir de puissance d''un homme d''affaires sans scrupules.', 1947, NULL, 'La vie est belle', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3f4995e9-46bf-45fc-a8f1-76509d59c220', 60, 'https://pictures.betaseries.com/films/affiches/original/76623.jpg', NULL, 'Film d''animation basé sur le manga Given de Kizu Natsuki reprenant directement là où la série télévisée s''est arrêtée.', 2020, NULL, 'Given The Movie', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('baa8e288-ed38-4b22-a423-a2150cdb787f', 120, 'https://pictures.betaseries.com/films/affiches/original/301.jpg', NULL, 'À la fin des années 80, Oh Dae-Soo, père de famille sans histoire, est enlevé un jour devant chez lui. Séquestré pendant plusieurs années dans une cellule privée, son seul lien avec l''extérieur est une télévision. Par le biais de cette télévision, il apprend le meurtre de sa femme, meurtre dont il est le principal suspect. Au désespoir d''être séquestré sans raison apparente succède alors chez le héros une rage intérieure vengeresse qui lui permet de survivre. Il est relâché 15 ans plus tard, toujours sans explication. Oh Dae-Soo est alors contacté par celui qui semble être le responsable de ses malheurs, qui lui propose de découvrir qui l''a enlevé et pourquoi. Le cauchemar continue pour le héros.', 2004, NULL, 'Old Boy', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('138cb0ee-4239-47df-8f35-27f1ddec8aa7', 154, 'https://pictures.betaseries.com/films/affiches/original/59005.jpg', NULL, 'Misato et son groupe anti-NERV, Wille, arrivent à Paris rougie par la core-ization. L''équipage du vaisseau Wunder atterrit sur une tour de confinement. Ils ont 720 secondes pour remettre la ville sur pied. Une horde de NERV Evas apparaît et l''Unité Eva 8 améliorée de Mari doit l''intercepter. Entretemps, Shinji, Asuka et Rei flânent au Japon.', 2021, NULL, 'Evangelion : 3.0+1.0 Thrice Upon a Time', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('65489dfa-677b-4e70-8a36-46196ea9a6cf', 165, 'https://pictures.betaseries.com/films/affiches/original/3059.jpg', NULL, 'A bord du "Virginian", paquebot de croisière, Danny, un mécanicien, découvre un nouveau-né abandonné dans la salle de bal désertée. Il décide de l''élever et le baptise du nom de 1900.
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('fd68c952-9bd0-40c0-8a8d-ec01ee491ea6', 85, 'https://pictures.betaseries.com/films/affiches/original/160.jpg', NULL, 'Disney présente l''histoire de Simba, un fougueux lionceau qui « voudrait déjà être roi ». Éloigné par son sombre et ambitieux oncle Scar, Simba profite de la vie avec ses drôles de compagnons Timon et Pumbaa, oubliant son rang et ses responsabilités. Mais son destin l''appelle à rentrer auprès des siens et à reprendre sa place dans le Grand Cercle de la Vie.', 1994, NULL, 'Le Roi lion', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('4ad091df-9302-406e-b991-79598837d0b6', 98, 'https://pictures.betaseries.com/films/affiches/original/71289.jpg', NULL, 'Un facteur égoïste et un fabricant de jouets solitaire forgent une amitié improbable, apportant la joie à une bourgade sombre et froide qui en a désespérément besoin.', 2019, NULL, 'Klaus', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b1beb658-f78c-4abe-bcc0-da2d75ed1ea4', 121, 'https://pictures.betaseries.com/films/affiches/original/82232.jpg', NULL, 'Zach Sobiech, un adolescent de 17 ans doué pour la musique, est atteint d’un cancer des os (ostéosarcome). Élève en terminale, il déborde de vie et de projets. Mais lorsqu’il apprend que son cancer est généralisé, il décide avec sa meilleure amie Sammy - qui compose avec lui - de profiter au maximum du peu de temps qu’il lui reste. Grâce à leur professeur M. Weaver, Zach et Sammy parviennent à signer un contrat avec une maison de disques. Accompagné de sa petite amie Amy et de ses parents Rob et Laura, Zach va vivre d’intenses moments où l’amitié et l’amour se conjuguent au son de la force évocatrice de la musique.', 2020, NULL, 'Clouds', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('29e9d7c0-8723-4283-90ef-99ee4c4e490a', 149, 'https://pictures.betaseries.com/films/affiches/original/22950.jpg', NULL, 'Les Avengers et leurs alliés devront être prêts à tout sacrifier pour neutraliser le redoutable Thanos avant que son attaque éclair ne conduise à la destruction complète de l’univers.', 2018, NULL, 'Avengers : Infinity War', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ae2d0961-4df4-43f8-aa13-e7d1937bfe21', 138, 'https://pictures.betaseries.com/films/affiches/original/20077.jpg', NULL, 'Une veuve mono-parentale hérite de la garde de son fils, un adolescent profondément turbulent. Ensemble, ils tentent de joindre les deux bouts, notamment grâce à l’aide inattendue de la mystérieuse voisine d’en face, Kyla. Tous les trois, ils retrouvent une forme d’équilibre et, bientôt, d’espoir.', 2014, NULL, 'Mommy', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f62bea0a-7197-473a-9625-5107c7ec0489', 90, 'https://pictures.betaseries.com/films/affiches/original/78543.jpg', NULL, 'Suite à ses deux invasions ratées de la Terre,  Darkseid a été sur un chemin de guerre, conquérant d''innombrables mondes. À la Watchtower, la Justice League , rejointe par de nouveaux membres John Constantine et son amant Zatanna , fait un plan pour contrer son invasion à travers l''univers. Cependant, à leur insu, Darkseid les regarde à travers la technologie de Victor Stone . La Ligue se dirige vers Apokolips tandis que les Teen Titans restent sur Terre en tant que "garde à domicile". A leur arrivée, la Ligue est attaquée par des "Paradooms"; hybrides génétiques de Parademons et Doomsday . Pendant l''attaque, plusieurs héros sont tués. Darkseid démantèle Cyborg - qui permet à Shazam de s''échapper - et remplace ses pièces par la technologie apokoliptienne, asservit Diana , Starfire , Hawkman , Mera et Martian Manhunter pour devenir ses Furies mécanisées, place Batman dans son contrôle mental, faisant de lui son bras droit, et injecte à Clark Kent du liquide de Kryptonite, le dépower...', 2020, NULL, 'Justice League Dark: Apokolips War', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('2aeb3531-a972-4c6d-be4e-96c36a84522c', 124, 'https://pictures.betaseries.com/films/affiches/original/3364.jpg', NULL, 'En 1945, trois amis qui ont pris part à la Résistance italienne célèbrent la chute du fascisme et la fin de la guerre. La République remplace la monarchie et tous trois poursuivent leur chemin séparément. Antonio reprend sa place de brancardier dans un hôpital romain, tandis que Nicola s''en va enseigner en province et que Gianni entre comme stagiaire chez un illustre avocat. Antonio s''éprend de la belle Luciana, qui partage un temps sa vie, avant de lui préférer l''ambitieux Gianni. Sur un coup de tête, Nicola quitte tout, travail et famille, pour se consacrer entièrement à sa passion, le cinéma, désormais libre de toute propagande fascisante…', 1976, NULL, 'Nous nous sommes tant aimés', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('5fdb72dd-7929-49b4-9b01-f26c886b6b84', 90, 'https://pictures.betaseries.com/films/affiches/original/68655.jpg', NULL, 'Sakuta Azusagawa, élève de 1ère, habite Fujisawa, une ville où resplendissent ciel et mer. Il vit un quotidien palpitant avec sa petite amie Mai Sakurajima, jusqu''au jour où débarque son premier amour, Shôko Makinohara, en qui cohabitent en fait deux personnes : une adulte et une collégienne. Sakuta, contraint d''héberger Shôko qui se joue de lui, voit ses relations avec Mai devenir de plus en plus tendues. Mais il se trouve que Shôko la collégienne souffre d’une grave maladie. La cicatrice de Sakuta recommence à le lancer...', 2019, NULL, 'Rascal Does Not Dream of a Dreaming Girl', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('55921c08-b7e7-454c-8e3d-6a414755d6c9', 108, 'https://pictures.betaseries.com/films/affiches/original/66784.jpg', NULL, 'Un lycéen trouve dans un hôpital le journal intime d''une de ses camarades de classe, une certaine Sakura Yamauchi. À l''intérieur de ce cahier, le lycéen découvre que la jeune lycéenne souffre d''un cancer du pancréas en phase terminale, un secret qu''il est le seul à connaître. Alors que ses jours sont comptés, Sakura décide de passer les derniers instants de sa vie avec le lycéen.', 2020, NULL, 'Je veux manger ton pancréas', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('7d6d309d-8dfd-4daa-8734-5069d5e6e3f6', 130, 'https://pictures.betaseries.com/films/affiches/original/64376.jpg', NULL, 'En 1962, alors que règne la ségrégation, Tony Lip, un videur italo-américain du Bronx, est engagé pour conduire et protéger le Dr Don Shirley, un pianiste noir de renommée mondiale, lors d’une tournée de concerts. Durant leur périple de Manhattan jusqu’au Sud profond, ils s’appuient sur le Green Book pour dénicher les établissements accueillant les personnes de couleur, où l’on ne refusera pas de servir Shirley et où il ne sera ni humilié ni maltraité. Dans un pays où le mouvement des droits civiques commence à se faire entendre, les deux hommes vont être confrontés au pire de l’âme humaine, dont ils se guérissent grâce à leur générosité et leur humour. Ensemble, ils vont devoir dépasser leurs préjugés, oublier ce qu’ils considéraient comme des différences insurmontables, pour découvrir leur humanité commune.', 2019, NULL, 'Green Book : Sur les routes du Sud', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3983c46e-2867-4277-8df1-1b3413355675', 117, 'https://pictures.betaseries.com/films/affiches/original/72597.jpg', NULL, 'Le groupe de Tanjirô a terminé son entraînement de récupération au domaine des papillons et embarque à présent en vue de sa prochaine mission à bord du train de l''infini, d''où quarante personnes ont disparu en peu de temps. Tanjirô et Nezuko, accompagnés de Zen''itsu et Inosuke, s''allient à l''un des plus puissants épéistes de l''armée des pourfendeurs de démons, le Pilier de la Flamme Kyôjurô Rengoku, afin de contrer le démon qui a engagé le train de l''Infini sur une voie funeste.', 2021, NULL, 'Demon Slayer : Kimetsu no Yaiba - Le film : Le train de l''Infini', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('551a652b-f8d9-428d-a728-48a82fc8449f', 145, 'https://pictures.betaseries.com/films/affiches/original/33044.jpg', NULL, 'Corée. Années 30, pendant la colonisation japonaise. Une jeune femme est engagée comme servante d’une riche japonaise, vivant recluse dans un immense manoir sous la coupe d’un oncle tyrannique. Mais Sookee a un secret. Avec l’aide d’un escroc se faisant passer pour un comte japonais, ils ont d’autres plans pour Hideko…', 2016, NULL, 'Mademoiselle', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('1c87b3f8-d6a8-4d9a-adf9-27e7c9acc2cf', 99, 'https://pictures.betaseries.com/films/affiches/original/2133.jpg', NULL, 'Chez Matuschek et Cie, une grande boutique de maroquinerie, le jeune Alfred Kralik, l''adjoint du patron, et Klara Novak, une nouvelle employée, vont échanger une correspondance amoureuse, sans savoir qui ils sont, à l''aide de petites annonces.', 1940, NULL, 'Rendez-vous', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('8c1c6178-f74d-4bd0-af86-83eb37685249', 117, 'https://pictures.betaseries.com/films/affiches/original/156.jpg', NULL, 'Hana et ses deux enfants, Ame et Yuki, vivent discrètement dans un coin tranquille de la ville. Leur vie est simple et joyeuse, mais ils cachent un secret : leur père est un homme‐loup. Quand celui‐ci disparaît brutalement, Hana décide de quitter la ville pour élever ses enfants à l’abri des regards. Ils emménagent dans un village proche d’une forêt luxuriante…', 2012, NULL, 'Les Enfants loups, Ame & Yuki', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('05afa0c1-7045-40ae-a00f-e85bc4abdcb2', 105, 'https://pictures.betaseries.com/films/affiches/original/22665.jpg', NULL, 'Un week-end du 15 août à Rome. Au volant de sa voiture de sport, Bruno cherche en vain un endroit d''où passer un coup de fil. Il demande à un étudiant, Roberto, de le laisser téléphoner chez lui. Entre le jeune homme timide et le play-boy imprudent, une étrange amitié va naître. Séduit malgré lui, Roberto se laisse entraîner par son mentor dans une longue virée à travers la ville et dans la campagne romaine. Les deux hommes s''arrêtent même dans la maison que possède une tante de Roberto. En un clin d''œil, Bruno dévoile à son jeune ami quelques secrets familiaux que ce dernier n''avait pas réussi à percer en tant d''années…', 1963, NULL, 'Le Fanfaron', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('30260b7d-b246-490e-8fd0-9c832b7134b4', 125, 'https://pictures.betaseries.com/films/affiches/original/901.jpg', NULL, 'C.C. Baxter est employé à la Sauvegarde, grande compagnie d''assurance. Dans l''espoir d''un avancement il prête souvent son appartement à ses supérieurs qui y emmènent leurs petites amies. Un jour le chef du personnel le convoque et lui apprend qu''il sait tout et lui demande aussi sa clé. Baxter est enfin promu. Mais ce qu''il ignorait c''est que le chef du personnel emmenait dans son appartement la femme dont il était amoureux.', 1960, NULL, 'La Garçonnière', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c795ed00-6a53-4118-b98b-415aaf23e070', 119, 'https://pictures.betaseries.com/films/affiches/original/223.jpg', NULL, 'Jack Torrance, gardien d’un hôtel fermé l’hiver, sa femme et son fils Danny s’apprêtent à vivre de longs mois de solitude. Danny, qui possède un don de médium, le «Shining», est effrayé à l’idée d’habiter ce lieu, théâtre marqué par de terribles événements passés…', 1980, NULL, 'Shining', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ef8bf000-4fc3-43bb-acae-51f83994a163', 110, 'https://pictures.betaseries.com/films/affiches/original/28461.jpg', NULL, 'Depuis déjà plusieurs générations, la musique est bannie dans la famille de Miguel. Un vrai déchirement pour le jeune garçon dont le rêve ultime est de devenir un musicien aussi accompli que son idole, Ernesto de la Cruz. Bien décidé à prouver son talent, Miguel, par un étrange concours de circonstances, se retrouve propulsé dans un monde étonnant et coloré lié aux célébrations des ancêtres. Là, il se lie d’amitié avec Hector, un gentil garçon mais un peu filou sur les bords. Ensemble, ils vont accomplir un voyage extraordinaire qui leur révèlera la véritable histoire qui se cache derrière celle de la famille de Miguel…', 2017, NULL, 'Coco', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('06fa11b9-b98b-4484-8b04-bcb58352b007', 116, 'https://pictures.betaseries.com/films/affiches/original/14947.jpg', NULL, 'Sir Wilfrid, un brillant et expérimenté avocat spécialiste des causes perdues, sort d''un séjour prolongé à l''hôpital et doit, pour des raisons de santé, renoncer à s''occuper d''affaires criminelles trop stimulantes. C''est à ce moment que Leonard Vole, accusé du meurtre de Mme French, vient lui demander son aide. Bien que l''affaire paraisse passionnante, Sir Wilfrid refuse de s''en occuper pour préserver sa santé et conseille un autre avocat, Mr Brogan-Moore, un de ses anciens élèves. Après le départ de Leonard Vole du bureau de Sir Wilfrid, Christine Vole, la femme de Leonard, fait son apparition. Elle est son seul alibi pour le soir du meurtre. Son attitude très froide et son rôle crucial dans l''affaire font changer Sir Wilfrid d''avis, qui décide malgré les recommandations des médecins de s''occuper de cette affaire fascinante.', 1958, NULL, 'Témoin à charge', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('4522371c-613d-4fe5-86d2-b35fe39f31dd', 155, 'https://pictures.betaseries.com/films/affiches/original/164.jpg', NULL, 'Le général romain Maximus est le plus fidèle soutien de l''empereur Marc Aurèle, qu''il a conduit de victoire en victoire avec une bravoure et un dévouement exemplaires. Jaloux du prestige de Maximus, et plus encore de l''amour que lui voue l''empereur, le fils de Marc Aurèle, Commode, s''arroge brutalement le pouvoir, puis ordonne l''arrestation du général et son exécution. Maximus échappe à ses assassins mais ne peut empêcher le massacre de sa famille. Capturé par un marchand d''esclaves, il devient gladiateur et prépare sa vengeance.', 2000, NULL, 'Gladiator', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b47cd3d7-b828-4d9a-a35b-bcbb16eef62b', 160, 'https://pictures.betaseries.com/films/affiches/original/78522.jpg', NULL, 'Captation de la célèbre comédie musicale de Broadway récompensée par 11 Tony, Grammy et Olivier Awards, et par un prix Pulitzer. Hamilton raconte l''histoire d''Alexander Hamilton, l''un des Pères fondateurs de la nation américaine.', 2020, NULL, 'Hamilton', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('252a0ee6-ac59-49b1-a0bd-d7c74a616fac', 109, 'https://pictures.betaseries.com/films/affiches/original/63414.jpg', NULL, 'Enzo n''est pas un chien comme les autres. Philosophe dans l''âme, il aime s''instruire devant la télévision et écouter attentivement les leçons de vie de son maître, Denny Swift, un pilote automobile. Aujourd''hui, Enzo se souvient de tout ce que sa famille et lui-même ont traversé au cours des années...', 2019, NULL, 'Dans les yeux d''Enzo', 'MOVIE');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c51bed5d-fd5d-4051-8df8-29b8f3e24976', 42, 'https://pictures.betaseries.com/fonds/poster/fd00589dd9300c623dcb492a7a6121e4.jpg', true, 'À une période faste de sa vie, l''amour et l''argent sont ce qui compte le plus pour Berlin qui prépare un coup de maître : un braquage de bijoux estimés à 44 millions.', 2023, 1, 'Berlin (2023)', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3866b7fa-c81a-438f-ab6b-133712f3e009', 33, 'https://pictures.betaseries.com/fonds/poster/ef67d23d1a1295b19a68e0130c0152de.jpg', true, 'Le demi-dieu Percy Jackson mène une quête à travers l''Amérique pour empêcher une guerre entre les dieux de l''Olympe.', 2023, 1, 'Percy Jackson et les Olympiens', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6fb647b9-94c1-4910-9abe-05044ff7c65a', 50, 'https://pictures.betaseries.com/fonds/poster/584685609e579cd3aefe7453eafe8401.jpg', false, 'Quand Maya, une ancienne soldate, aperçoit sur une caméra espion son mari qu''elle pensait assassiné, elle découvre un complot meurtrier ancré au plus profond du passé.', 2024, 1, 'Double piège', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('0230c86a-f049-4f3e-8774-912f1aee46fb', 49, 'https://pictures.betaseries.com/fonds/poster/222db9c9a70fdbb741f1701287d32118.jpg', true, 'Après avoir survécu à l''attaque de Godzilla sur San Francisco, Cate découvre un nouveau terrible secret. Face à la menace des monstres, elle se lance dans une aventure à travers le monde pour découvrir la vérité sur sa famille et sur une mystérieuse organisation, connue sous le nom de Monarch.', 2023, 1, 'Monarch: Legacy of Monsters', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('1adcc655-32f7-484f-9722-5209b84e0d82', 43, 'https://pictures.betaseries.com/fonds/poster/5979f936e2fb4451ae0f71cac22fc6e9.jpg', true, 'Quand une tragédie bouleverse sa vie, une ado emménage avec la grande famille de sa tutrice dans une petite ville où elle apprend beaucoup sur l''amour, l''espoir et l''amitié.', 2023, 1, 'Ma vie avec les Walter Boys', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a531ceb6-88ca-4841-a37e-820bcd58138d', 55, 'https://pictures.betaseries.com/fonds/poster/61f4491be4f553b57848ba6b03ede0ca.jpg', true, 'Au coeur de l''univers de "Squid Game", 456 joueurs réels mettent leurs compétences et leur personnalité à rude épreuve. Le prix ? 4,56 millions de dollars qui changeraient leur vie.', 2023, 1, 'Squid Game : Le défi', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e2c3a90b-0b62-444f-84af-6874cb462dad', 56, 'https://pictures.betaseries.com/fonds/poster/9ce8a0e2e1d9ebdcea9f541512dd9938.jpg', false, 'Quatre enquêteurs. Quatre époques. Une victime. Afin de sauver l''avenir, il leur faudra d''abord élucider le meurtre qui a changé le cours de l''histoire.', 2023, 1, 'Bodies', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('88132dd2-ac8a-4f36-abf3-3e476b043e13', 36, 'https://pictures.betaseries.com/fonds/poster/ca652e992d8e6cb4e9d69b96865be160.jpg', false, 'Marvel Studios présente « Echo », qui met en lumière Maya Lopez poursuivie par l''empire criminel de Wilson Fisk. Quand son périple la ramène sur ses terres d’origine, elle doit affronter sa propre famille et son héritage.', 2024, 1, 'Echo', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('5b342d5c-9a09-4f24-a6e4-58ae1f54383d', 59, 'https://pictures.betaseries.com/fonds/poster/9e9ba2df1cadce87828d241fdabac3b3.jpg', true, 'Des jeunes adultes avec des pouvoirs sont mis à rude épreuve et subissent de nombreux tests au sein de la Godolkin University School of Crimefighting tenue par Vought International', 2023, 1, 'Gen V', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e66b424f-1f19-44a1-9c22-ccafaef1b115', 58, 'https://pictures.betaseries.com/fonds/poster/e84a901ff06839a1a3a6743a061933fe.jpg', true, 'Cette série en prises de vues réelles raconte les aventures d''un pirate peu ordinaire, d''après le célèbre manga d''Eiichiro Oda.', 2023, 1, 'One Piece (2023)', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('309edc98-1228-4ecd-aec6-75803e0e9c44', 52, 'https://pictures.betaseries.com/fonds/poster/ebe6dad1cab9162531fbe245aae41247.jpg', true, 'Alors qu''un violent dealer tente de prendre Marseille, un flic aux méthodes douteuses et son équipe de têtes brûlées accueillent une nouvelle recrue, qui n''est pas là par hasard.', 2023, 1, 'Pax Massilia', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('8ee56e3d-7249-421b-b617-5754a640b23e', 52, 'https://pictures.betaseries.com/fonds/poster/5ef37636ba989c03514f5daf1fb4404c.jpg', true, 'Fière d''avoir déjoué un attentat, une unité d''élite se lâche pendant une grosse fête. Mais quand la vraie menace arrive, c''est dégrisement express pour sauver Las Vegas.', 2023, 1, 'Chargés à bloc', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f240224d-ea40-4903-80a8-232c9fc5ae19', 45, 'https://pictures.betaseries.com/fonds/poster/f4313dd8ebe4d35505b820b6ffe2f259.jpg', true, 'Quand Jack Reacher, ancien officier de la police militaire, est accusé à tort de meurtre, il se retrouve au milieu d''une conspiration où nagent flics corrompus, hommes d''affaires louches et politiciens sournois. Grâce à son intelligence, il doit découvrir ce que cache la ville de Margrave, en Géorgie. La première saison de Reacher est basée sur le best-seller de Lee Child, "Du fond de l''abîme".', 2022, 2, 'Reacher', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e2011e85-aae8-4e96-9304-fdc16cb8a57d', 60, 'https://pictures.betaseries.com/fonds/poster/3b2bfdfc152474a5145356d9f4c476c6.jpg', true, 'Un spin-off de la série "The Walking Dead" centré sur Daryl Dixon en France.
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('511d04c7-5fce-4f46-8602-86243cb15361', 63, 'https://pictures.betaseries.com/fonds/poster/364302529d28e4576782b3cd1f2c4739.jpg', false, 'Vers la fin de la Seconde Guerre mondiale, le destin d''une adolescente française aveugle croise celui d''un jeune soldat allemand. D''après le best-seller d''Anthony Doerr.', 2023, 1, 'Toute la lumière que nous ne pouvons voir', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6e322f90-8983-47e5-9c50-20c92aa01d08', 48, 'https://pictures.betaseries.com/fonds/poster/b5dc9ae24c0763d09c791041f4db677c.jpg', true, 'A présent étudiante à la singulière Nevermore Academy, Wednesday Addams tente de s''adapter auprès des autres élèves tout en enquêtant à la suite d''une série de meurtres qui terrorise la ville...', 2022, 1, 'Mercredi', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e9c02d16-5e91-48f9-97bb-57a2ee567922', 48, 'https://pictures.betaseries.com/fonds/poster/4dae1da8e16f929c16b50097361a7970.jpg', true, 'Cherchant à se venger de ceux qui ont fait d''elle une paria dans le Japon de l''époque d''Edo, une jeune guerrière se fraye un chemin sanglant vers son destin.', 2023, 1, 'Blue Eye Samurai', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('86a981c9-0022-417c-a027-f35ee1490256', 61, 'https://pictures.betaseries.com/fonds/poster/5180fbc079b93b23eb36d34e742b7d87.jpg', false, 'Pour assurer la pérennité de leur fortune, un frère et une sœur impitoyables fondent une dynastie que menacent les morts mystérieuses de leurs héritiers, un par un.', 2023, 1, 'La Chute de la maison Usher', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f790dc91-3c6b-4e2b-8e1f-1c787bf454be', 62, 'https://pictures.betaseries.com/fonds/poster/310d86f1686b368da8f322ee5fcb6a34.jpg', true, 'De Steven Spielberg, Tom Hanks et Gary Goetzman, les producteurs de Frères d''armes et Band of Brothers : l''Enfer du Pacifique. Pendant la Seconde Guerre mondiale, des pilotes de chasse risquent leur vie au sein du 100e groupe de bombardement, une confrérie unie par le courage, les défaites et les victoires.', 2024, 1, 'Masters of the Air', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3d8f82df-17a9-4fd2-972d-3224dce148d7', 51, 'https://pictures.betaseries.com/fonds/poster/91ae06357bd6e864c83fb0e0321d2141.jpg', true, 'L’escroquerie du siècle, survenue en France et en Europe entre 2008 et 2009. Des milliards partis en fumée sur le nouveau marché financier des "quotas carbone" inventé pour lutter contre le réchauffement climatique. L''association d’escrocs de Belleville avec un trader des beaux quartiers, traqués par un enquêteur obsessionnel. Quand les passions humaines se déchaînent au-delà du simple intérêt.
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b0493352-b164-4e0f-80cd-ef678340c254', 48, 'https://pictures.betaseries.com/fonds/poster/443aa265cbdce749b80554595fa17d81.jpg', true, 'Quand sa famille est attaquée, un membre d''une triade de Taipei se rend à Los Angeles pour protéger sa mère forte tête et son frère qui ignore tout de leurs activités.', 2024, 1, 'Les Frères Sun', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('12f935ad-9c25-4e63-b041-4523778e4d34', 30, 'https://pictures.betaseries.com/fonds/poster/1f6bc39e2187a0c3794b13ce3720994b.jpg', false, 'Pour échapper à une sanction de la commission de discipline du FBI, les agents Richard Bullit et Douglas Riper retournent sur le terrain. Ils doivent arrêter un mystérieux tueur en série qui s’attaque à des youtubeurs stars d’internet. Une enquête d’autant plus compliquée que les deux agents cachent la bavure qu’ils ont commise en provoquant, malgré eux, la mort accidentelle de leur premier suspect. Ce qui ne manque pas d’éveiller les soupçons de Jessica Carson, leur jeune rivale au FBI…', 2023, 1, 'Pamela Rose, la série', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c14f9983-902a-45f4-9ebe-2ae2a499a29e', 24, 'https://pictures.betaseries.com/fonds/poster/02ca7882a5f055281bbea715c2802dab.jpg', true, 'Ce qui ne vous tue pas vous rend plus fort ! Mais ce dicton ne s''applique pas au chasseur le plus faible de toute l’humanité, Jinwoo Sung. Après avoir été mortellement blessé lorsqu’il est tombé par hasard sur un double donjon caché, Jinwoo est miraculeusement rescapé. Au bord de la mort, il entrevoit une quête et saisit une opportunité qui lui permet dès lors de gagner en puissance très rapidement. À présent, il souhaite découvrir les secrets de ses pouvoirs et du donjon qui les a engendrés.', 2024, 1, 'Solo Leveling', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a07772e2-a6fa-4301-a586-3ad97beb602b', 59, 'https://pictures.betaseries.com/fonds/poster/10563d845748d86fdfebf3de177510f6.jpg', false, 'Après avoir fui Medellín pour Miami avec ses trois jeunes fils et un kilo de cocaine, Griselda Blanco devient la cruelle baronne d''un empire de la drogue en plein essor.', 2024, 1, 'Griselda', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('72cce576-0c06-406c-930c-dd129823141d', 56, 'https://pictures.betaseries.com/fonds/poster/802f834b56147d2bdfb1ed5599a2445d.jpg', false, 'Son plat préféré ? Les ramen. Son arme fétiche ? Le Pistolet Spirituel. Un ado rebelle doit apprendre à manier ses nouveaux pouvoirs pour sauver les siens.', 2023, 1, 'Yu Yu Hakusho (2023)', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('525e8f83-b1fe-4f91-8fb4-727978b12d9b', 37, 'https://pictures.betaseries.com/fonds/poster/8427e59e29b10afb143e680ecc7e6a8b.jpg', true, 'L''ancienne Chevalier Jedi Ahsoka enquête sur une menace qui pèse sur une galaxie encore vulnérable.', 2023, 1, 'Ahsoka', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('63679a16-f77e-4b7f-ba9c-babb2ad1a058', 52, 'https://pictures.betaseries.com/fonds/poster/bd93674308d2990761125eff79835fa7.jpg', true, 'Fin des années 1980, dans le nord de la France, des femmes sont violées tôt le matin, toujours de la même manière, sur la même route, le long de la rivière Sambre. Les policiers ne prennent pas la mesure de ces agressions et ne font pas le lien entre elles. La justice est débordée devant les dossiers qui s’accumulent. Il faudra trente ans pour arrêter un homme qui n’a jamais cessé d’agresser les femmes et qui est responsable d’au moins 54 viols ou agressions sexuelles.', 2023, 1, 'Sambre', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('af1c7b59-e92c-4a85-84e3-25b3a9c0aa74', 59, 'https://pictures.betaseries.com/fonds/poster/d0769ddbea86286683e32154731aa950.jpg', true, '20 ans après la destruction de la civilisation moderne, Joël, un survivant aguerri est embauché pour aider Ellie, une jeune fille de 14 ans, à s''échapper d''une zone de quarantaine oppressive. Ce qui ne devait être qu''un petit boulot va rapidement tourner en une aventure déchirante à travers les États-Unis, où ils devront compter sur l''un et l''autre pour survivre.', 2023, 1, 'The Last of Us', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('175cee57-53e5-402a-90c0-d77242e27d98', 46, 'https://pictures.betaseries.com/fonds/poster/441e458683e13ab6adc07c4913d48520.jpg', false, 'Dans les années 1950, Elizabeth Zott rêve de devenir scientifique. Elle est remise en question par une société qui considère que les femmes n''appartiennent qu''à la sphère domestique. Elle accepte un emploi dans une émission de cuisine télévisée et entreprend d''enseigner bien plus que des recettes à une nation de femmes au foyer négligées.', 2023, 1, 'Lessons In Chemistry', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e8bab1ce-da03-4263-9cf6-9e3286cb05c0', 68, 'https://pictures.betaseries.com/fonds/poster/ee5a3c54d11bf404cf712837e9882389.jpg', false, 'Un démon sans pitié perd ses pouvoirs après s''être lié avec une héritière hautaine qui semble détenir la clé de son malheur... mais aussi celle de son cœur.', 2023, 1, 'Mon démon', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e560706b-477f-480e-af86-14d45aba78e6', 71, 'https://pictures.betaseries.com/fonds/poster/964cf05a3e83e93a2c44dac57d9954e6.jpg', false, 'Darby Hart, détective amateur et pirate informatique de la génération Z, est invitée à séjourner dans un lieu isolé. Lorsque l''un des invités est retrouvé mort, Darby doit utiliser ses compétences pour prouver qu''il s''agit d''un meurtre avant que le tueur ne récidive.', 2023, 1, 'Un meurtre au bout du monde', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('d3d198d1-66ea-4780-ad22-a652d7f61ab2', 29, 'https://pictures.betaseries.com/fonds/poster/cf3802c9e090e659febdfa0e5b6aa3ec.jpg', true, 'L''histoire d''amour longue distance de Kitty, ado entremetteuse, rebondit quand elle rejoint son petit ami dans le lycée de Séoul que sa défunte mère avait fréquenté.', 2023, 1, 'XO, Kitty', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('047671e5-77d2-4ffd-addb-e560bc1119eb', 47, 'https://pictures.betaseries.com/fonds/poster/5da2b1d3d7e75d3afe82ae3c30ed0919.jpg', true, 'Dans un monde futur dévasté et toxique, des milliers de survivants habitent un gigantesque silo souterrain. Après la transgression d''une règle d''or par leur shérif et la mort mystérieuse de plusieurs résidents, Juliette, une mécanicienne, perce peu à peu les terribles secrets du Silo.', 2023, 1, 'Silo', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a467b35f-a2e7-4106-9f3b-e9d6b1a4932e', 45, 'https://pictures.betaseries.com/fonds/poster/c276d65f22c9901bbd775269918dc504.jpg', true, 'Alors qu''il est de garde sur une ligne d''urgence, un agent du FBI répond à un appel qui le plonge dans un complot meurtrier impliquant une taupe à la Maison Blanche. D''après le roman de Matthew Quirk (titre français : Une affaire personnelle)', 2023, 1, 'The Night Agent', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('51668453-2553-435e-8a8d-a4f8e2b2b0a6', 29, 'https://pictures.betaseries.com/fonds/poster/3347803f6bea1552c9b177d0f5905f96.jpg', true, 'Carmy, un jeune cuisinier gastronomique, revient à Chicago pour reprendre la sandwicherie familiale. Tandis qu''il se bat pour transformer la boutique et devenir un homme meilleur, il travaille aux côtés d''une équipe de cuisiniers mal dégrossis qui se révèle une formidable deuxième famille.', 2022, 2, 'The Bear : sur place ou à emporter', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('66bf648f-32f0-41eb-bb48-d508e916951a', 47, 'https://pictures.betaseries.com/fonds/poster/6969a993554a98825a012e3e36dbad36.jpg', false, 'L''univers apparemment idéal de parents et de leur fille est bouleversé quand un meurtre choquant révèle qu''ils sont prêts à commettre des actes désespérés pour se protéger mutuellement.', 2023, 1, 'Une Famille presque normale', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('a27b1945-2c99-4768-8f4a-f95f2aefd4b0', 55, 'https://pictures.betaseries.com/fonds/poster/d3d9745dee88c194f2cfab1996d7958d.jpg', false, 'Promise au roi d’Angleterre contre son gré, Charlotte arrive à Londres et découvre que la famille royale n''est pas ce qu''elle imaginait. Le temps aidant, la jeune fille trouve ses marques au sein du palais, entre l''étiquette et son imprévisible mari. Malgré les difficultés, Charlotte est en passe de devenir l’une des monarques les plus incontournables d’Europe.', 2023, 1, 'La Reine Charlotte : Un chapitre Bridgerton', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('8e80fb08-189b-41f6-a629-6aef91b64f6a', 68, 'https://pictures.betaseries.com/fonds/poster/b28460c50f2c6b6a06d998e00cdf4a26.jpg', true, 'Au printemps 1945, un jeune homme et une jeune femme luttent pour leur survie dans un monde sinistre, tout en combattant des monstres engendrés par la cupidité humaine.', 2023, 1, 'La Créature de Kyŏngsŏng', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6978cd3e-2a94-43dc-a63a-35beaaf90d00', 27, 'https://pictures.betaseries.com/fonds/poster/f77ec6ad743a8ee116424cfa9a90c9e9.jpg', false, 'Quand il rencontre Ramona Flowers, la fille de ses rêves, Scott Pilgrim découvre que ses sept ex maléfiques s''opposent à leur amour.', 2023, 1, 'Scott Pilgrim prend son envol', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('0e64e6b7-07c3-43d3-9ae9-cdb7278631b6', 86, 'https://pictures.betaseries.com/fonds/poster/2199064b6a7a17f86ee01a90211117a5.jpg', false, '"Le Continental", série évènement qui révèle les origines violentes de l''hôtel pour tueurs iconique de l''univers de John Wick. Dans le New York des années 1970, Winston Scott recrute une équipe pour déjouer une vaste conspiration née de l''attaque perpétrée sur le Continental par son frère. L''intrigue, faite d''action et d''hémoglobine, explore les conflits entre amour familial, destin et vengeance.', 2023, 1, 'Le Continental : D''après l''univers de John Wick', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('e6bfa578-1976-43bb-9676-056e1d841627', 45, 'https://pictures.betaseries.com/fonds/poster/65641ead1e4581251cb8618b14a88836.jpg', true, 'Une bande d’Américaines fêtardes débarque sur la scène guindée de Londres dans les années 1870, provoquant un clash culturel anglo-saxon. Envoyées pour assurer leur mariage et leur statut, le cœur de ces jeunes filles aspire à quelque chose de bien différent.', 2023, 1, 'The Buccaneers', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c5c37c40-4efc-4f2d-bf28-7030b51d48da', 57, 'https://pictures.betaseries.com/fonds/poster/596299fd094c9f2a30c3cfd880789a60.jpg', false, 'La vie de famille tranquille de deux couples de croyants d''une petite ville du Texas prend fin quand ils rencontrent Candy Montgomery... la tueuse à la hâche.', 2023, 1, 'Love & Death', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('8fd54b7a-7b54-4997-966d-a56c3adfccb7', 54, 'https://pictures.betaseries.com/fonds/poster/force-35232-65392eee9adc2.jpg', true, 'Après avoir reçu un mystérieux message, David Rousseau, auteur de polars en panne d’inspiration, se rend à Mouthe, village le plus froid de France. Le même jour, un meurtre survient… Voyant l’opportunité inespérée d’un nouveau roman, Rousseau entame une enquête qui empiète sur celle de l’adjudant Louvetot. Le trouble s’installe définitivement lorsque les meurtres s’additionnent… Il y aurait un serial killer… à Mouthe ! (p.c.c. Séries Mania)', 2023, 1, 'Polar Park', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('9de4dc2f-32a8-465c-8224-53b2a01e74b3', 45, 'https://pictures.betaseries.com/fonds/poster/4e19b923c93f309c729d9522746bcf82.jpg', true, 'Lorsque sa femme le quitte et que son fils part à la fac, John Nolan, la quarantaine, est à un tournant de sa vie et décide de réaliser un vieux rêve : devenir flic ! Il part vivre à Los Angeles et se retrouve, malgré son âge, un bleu parmi les bleus...', 2018, 5, 'The Rookie : Le flic de Los Angeles', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f0853a38-636f-43df-a312-b543ff7c1ed6', 53, 'https://pictures.betaseries.com/fonds/poster/a0b3d077a9ecaff41b0fe21c6288bc16.jpg', false, 'De chanteur à businessman, de ministre à prisonnier, Bernard Tapie a tout connu. À travers ses réussites comme ses échecs, Wonderman retrace le destin romanesque d’une personnalité publique hors du commun.', 2023, 1, 'Tapie', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('1a094beb-be40-4df1-93d2-5493b9fa664c', 52, 'https://pictures.betaseries.com/fonds/poster/7f83988822a658fbaa834cc9bd6c0ad9.jpg', true, 'Pacifiste détendu et adepte du cool, PANDA (Julien Doré) tient une petite paillote dans un coin reculé de Camargue. Pas de portable, pas d''ordi, pas de voiture, il vit avec son ado de 16 ans dans ce parfait cocon de paix et de sérénité, et fuit tout ce qui ressemble de près ou de loin à un conflit. Comment imaginer que ce grand sage en tongs et t-shirt délavé ait un jour été flic ? Et pas n''importe lequel. Un des meilleurs. Hélas, même au paradis, y''a pas moyen d''être tranquille ! Le jour où son ancienne vie vient frapper à la porte, Panda se retrouve obligé de reprendre du service... Mais à sa façon. Sans arme ni violence et pas trop tôt le matin. Zen, quoi.', 2023, 1, 'Panda', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6a1d64f9-a7a1-4bb5-8c46-6d56fa7d43f7', 49, 'https://pictures.betaseries.com/fonds/poster/3aeb94437e03fed9509a3987381f41d7.jpg', false, 'Jack Dawkins mène une double vie en tant que chirurgien mais qui a conservé ses tendances criminelles.', 2023, 1, 'Le Renard : prince des voleurs', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b667e847-36c6-4922-a703-99a1b4094866', 45, 'https://pictures.betaseries.com/fonds/poster/f78cec24f9289cb74f48bf24ec69212a.jpg', true, 'John et Jane Smith, deux solitaires qui ne se connaissaient pas, ont abandonné leurs vies et leurs identités et se retrouvent forcés de collaborer dans leurs activités d''espionnage... mais aussi dans le mariage.', 2024, 1, 'Mr. & Mrs. Smith', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('24a107d8-c541-4712-bfba-570785e77286', 55, 'https://pictures.betaseries.com/fonds/poster/06c75207900a8c1c05baf880ab7c5341.jpg', false, 'Cette série documentaire révolutionnaire raconte l''extraordinaire aventure de la conquête, de l''adaptation et de la survie du vivant sur Terre au cours de milliards d''années.', 2023, 1, 'La Vie sur notre planète', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('77f79186-8474-439b-bd10-01672bd75b25', 47, 'https://pictures.betaseries.com/fonds/poster/877883619a67c6699047a7e976d4aae1.jpg', false, 'Une mystérieuse femme retenue captive parvient à échapper à son terrible ravisseur et réveille une enquête non résolue sur une sinistre disparition, treize ans plus tôt.', 2023, 1, 'Chère petite', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('5a35ce57-f41c-45f2-98a4-fae0a52e69a3', 52, 'https://pictures.betaseries.com/fonds/poster/8b4ff6b829d06b0d28918d9f97ae2d9c.jpg', true, 'Une famille ordinaire est confrontée à une catastrophe - la maladie grave de l’un de ses enfants. Chaque membre de la famille voit alors sa vie personnelle, impactée par cette épreuve. Les catastrophes rendent les gens plus humains. C’est-à-dire pas toujours meilleurs.', 2023, 1, 'Tout va bien', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('ecf24469-55e3-44ed-a018-cd7a06753b2b', 38, 'https://pictures.betaseries.com/fonds/poster/5ed48e89a0ecaff5405bc5fdffbe1860.jpg', false, 'Dans « Secret Invasion », qui se déroule dans le temps présent du MCU, Nick Fury découvre qu’une faction de Skrulls métamorphes prépare en secret une invasion de la Terre. Avec ses alliés, dont Everett Ross, Maria Hill et Talos le Skrull qui mène une vie de terrien, il se lance dans une course contre la montre pour déjouer la menace Skrull et sauver l’Humanité.', 2023, 1, 'Secret Invasion', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('f7ce62db-aeb3-49f6-a409-1fc1ddde722a', 46, 'https://pictures.betaseries.com/fonds/poster/52d1d0f6c398ccb4b0591b3a8eccfb11.jpg', false, 'La vie paisible d''une expatriée britannique à Barcelone part en vrille lorsqu''un cambriolage à main armée dans un supermarché dévoile son passé secret et violent.', 2023, 1, 'Qui est Erin Carter?', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b686b3a2-fbc1-4cf0-b089-5bc5391b976a', 60, 'https://pictures.betaseries.com/fonds/poster/f6bef79608593fa6aecbbad5809c0e44.jpg', false, 'Lorsque les sept robots les plus évolués et leurs alliés humains sont assassinés l''un après l''autre, l''inspecteur Gesicht ne tarde pas à réaliser qu''il est lui aussi en danger.', 2023, 1, 'Pluto', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('798c2317-3557-4e7a-a4aa-03235e822d4f', 36, 'https://pictures.betaseries.com/fonds/poster/fcdcf2881e1db3fd113f4b63cf358675.jpg', false, 'Un accès de violence entre deux conducteurs frustrés par leurs professions respectives déclenche une vendetta qui libère leurs instincts les plus sombres.', 2023, 1, 'Acharnés', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('8c27e6c0-3de1-4493-96dc-3d3fd108a7b9', 46, 'https://pictures.betaseries.com/fonds/poster/5632aa5165e2f4a422d812ee60d438a6.jpg', false, 'Lorsque le vol KA29 qui relie Dubaï à Londres en sept heures se voit détourné, Sam Nelson, un négociateur à succès, fait appel à ses compétences dans l''espoir de sauver les passagers. Mais cette stratégie à haut-risque pourrait le conduire à sa perte.', 2023, 1, 'Hijack', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('26d1a46b-98be-4470-b95f-e18e7d9a7922', 43, 'https://pictures.betaseries.com/fonds/poster/c449a907a8fe53736342cb3ea4d67df5.jpg', true, 'Inspiré par les aventures d''Arsène Lupin, le gentleman cambrioleur Assane Diop décide de venger son père d''une terrible injustice.', 2021, 2, 'Lupin', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c2fa9fa9-0c86-4b17-831e-c4b9fa251f34', 40, 'https://pictures.betaseries.com/fonds/poster/92d7a438130a00f6ec2acd18bbe3d975.jpg', true, 'En Camargue, quatre garçons en galère vont se retrouver, par hasard, à vendre leur corps. Amateurs, mais aidés par l’espiègle petite sœur du groupe, ils vont monter un service d’Escorts unique dans la région. Entre famille, mensonges et demandes toujours plus surprenantes, ils devront apprendre à jongler pour remonter le business familial et... s’en sortir enfin ? Adaptation de la série israélienne de 2015 "Milk & Honey"', 2023, 1, 'Escort Boys', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('9d50c99a-f52b-4457-895c-678443ad5891', 41, 'https://pictures.betaseries.com/fonds/poster/e1ec32af03c19f20378ae6b2fe45603f.jpg', true, 'Cruz Manuelos, une jeune Marine un peu brutale mais passionnée, a été recrutée pour rejoindre la mission Lioness afin d''aider à démanteler une organisation terroriste. Joe, la cheffe de station du programme Lioness, est chargée de former, de gérer et de diriger ces agents féminins infiltrés.', 2023, 1, 'Opérations Spéciales : Lioness', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c3b8cc82-b276-4be8-bf1b-0d91ab1cbba0', 57, 'https://pictures.betaseries.com/fonds/poster/eaaeb191c7a9858e047aa6902a15635a.jpg', false, 'Le charismatique, Hawkins Fuller, mène une carrière politique et évite les relations sentimentales, jusqu''à ce qu''il rencontre Tim Laughlin, un jeune homme débordant d''idéalisme. Ils entament une romance au moment où Joseph McCarthy et Roy Cohn déclarent la guerre aux "subversifs et aux déviants sexuels", initiant ainsi l''une des périodes les plus sombres de l''histoire américaine du XXe siècle. Au cours de quatre décennies, Hawk et Tim se croisent à travers les manifestations contre la guerre du Vietnam des années 1960, l''hédonisme disco alimenté par la drogue des années 1970 et la crise du sida des années 1980.', 2023, 1, 'Fellow Travelers', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6df8adf8-5f2b-4554-bb84-57ff338e7b4a', 57, 'https://pictures.betaseries.com/fonds/poster/076d2b7d70ffe48494e304abc65a3125.jpg', false, 'À Brisbane dans les années 80, au sous-sol de sa maison, Eli Bell répond à un téléphone rouge et commence un voyage qui va lui briser le cœur, avant de le reconstruire.', 2024, 1, 'Le Garçon et l''Univers', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('741932aa-005e-47bf-9182-87acab66cbf0', 54, 'https://pictures.betaseries.com/fonds/poster/10dff727bad61365f11ec1f327a14973.jpg', false, 'Une prétendue malédiction semble s''abattre sur un couple de jeunes mariés qui essaient de concevoir un enfant. Leur quotidien est filmé 24h sur 24h car ils participent à une émission de télé-réalité.', 2023, 1, 'The Curse', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('91c368ab-ebad-465f-9a4c-ee7971b1b866', 72, 'https://pictures.betaseries.com/fonds/poster/dcbb0e1c16352f9521545c89b0e6e353.jpg', false, 'S''appuyant sur des images inédites, cette série documentaire revient sur l''ascension fulgurante de David Beckham, de ses débuts modestes à son statut d''icône du football.', 2023, 1, 'Beckham', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3e7230da-5b26-4946-9ce3-442a2d72dd44', 50, 'https://pictures.betaseries.com/fonds/poster/35f4c2cb70e07b9c50185eb52b39d8aa.jpg', true, 'Au cœur de Londres, un appel anonyme précipite deux brillants policiers — une jeune femme au début de sa carrière et un homme bien placé déterminé à protéger son héritage — dans un combat pour rectifier une ancienne erreur judiciaire.', 2024, 1, 'Criminal Record', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('70c1e6a4-e2b7-4599-9733-a60e493b9760', 40, 'https://pictures.betaseries.com/fonds/poster/a7cc20eddb0900a1d160b0395794fa35.jpg', true, 'Quelques années après les évènements survenus au Commonwealth, Maggie et Negan se rendent dans un Manhattan post-apocalyptique coupé depuis longtemps du continent. La ville en ruine est peuplée de morts et d''habitants qui ont fait de New York, un monde anarchique empli de terreur.', 2023, 1, 'The Walking Dead - Dead City', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('bff9faa2-545e-480e-ab3f-a5e01a372790', 41, 'https://pictures.betaseries.com/fonds/poster/780bd8dd6e2553ff5b1eaf56f51b0a70.jpg', true, 'Un célèbre tailleur confectionne une robe de mariée pour la fiancée de son meilleur ami. Mais tous trois ont de sombres secrets qui vont bientôt bouleverser leurs vies.', 2023, 3, 'Le Tailleur', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('7bdb85d2-de5f-4c5c-9f6b-184ead6e5d55', 50, 'https://pictures.betaseries.com/fonds/poster/6f773cdbb40348ae47f41a2ad63b1039.jpg', false, 'Alors que Loki a été tué par Thanos dans Avengers : Infinity War, l''histoire prend place plus tôt, en 2012, dans une réalité alternative créée par le Casse temporel des Avengers après que le Loki de 2012 se fut échappé avec le Tesseract. Le Dieu de la Malice veut se servir des pouvoirs du Tesseract pour changer le cours de l''histoire humaine. Après son évasion, il est emmené auprès du Tribunal des Variations Anachroniques (ou TVA), un organisme qui agit pour empêcher toute personne qui tenterait d''altérer le passé ou le futur.', 2021, 2, 'Loki', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('48a0dc59-a0f1-4f5d-b438-572590a44820', 24, 'https://pictures.betaseries.com/fonds/poster/48d4716cbee941cd2ddcf7f386d779d5.jpg', true, 'Souffrance, regrets, humiliation : dans certains cas, leur accumulation dans un même endroit provoque des malédictions souvent fatales. Nous suivons le quotidien de Yuji Itadori, lycéen et membre du club de spiritisme. Il ne croit pas aux fantômes, mais sa force physique hors du commun est un précieux atout pour les missions du groupe… jusqu’à ce que l’une d’elles tourne mal. En avalant une relique pour conjurer un sort, le voilà possédé par Ryomen Sukuna, le célèbre démon à deux visages. Condamné à mort par l’organisation des exorcistes, il doit trouver et ingérer tous les doigts de Sukuna afin d’être libre. Et pour ça, l’adolescent va s’initier à l’art occulte et mystérieux de l’exorcisme.', 2020, 2, 'Jujutsu Kaisen', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('1b77ccad-66f2-472b-8846-720f13726f32', 0, 'https://pictures.betaseries.com/fonds/poster/7c63368ea5b164ff01553f6d5f950baa.jpg', false, 'Les nations de l''Eau, de la Terre, du Feu et de l''Air vivaient en harmonie... jusqu''au jour où tout a changé. Une adaptation en prise de vues réelles de l''histoire d''Aang.', 2024, 0, 'Avatar : Le dernier maître de l''air', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('5948eb63-fec8-4182-b284-86b30ff57814', 0, 'https://pictures.betaseries.com/fonds/poster/ffb69a7e691fd28240d2894c450d5138.jpg', false, 'The story of haves and have-nots in a world in which there’s almost nothing left to have. 200 years after the apocalypse, the gentle denizens of luxury fallout shelters are forced to return to the irradiated hellscape their ancestors left behind — and are shocked to discover an incredibly complex, gleefully weird, and highly violent universe.', 2024, 0, 'Fallout', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('d09cfb2c-a175-4a58-bc89-0e5f0aae2baa', 67, 'https://pictures.betaseries.com/fonds/poster/b70ba80957707c986601c467a5e38929.jpg', true, 'L''histoire de la famille Targaryen, 200 ans avant Game Of Thrones, alors que le roi Viserys règne sur Westeros.', 2022, 1, 'House of the Dragon', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('23d73342-f26b-441a-bcee-646c2b2d95eb', 24, 'https://pictures.betaseries.com/fonds/poster/825cf977639e529842dd9235d0b03157.jpg', false, 'Twilight, le plus grand espion du monde, doit pour sa nouvelle mission créer une famille de toutes pièces afin de pouvoir s’introduire dans la plus prestigieuse école de l’aristocratie. Totalement dépourvu d’expérience familiale, il va adopter une petite fille en ignorant qu’elle est télépathe, et s’associer à une jeune femme timide, sans se douter qu’elle est une redoutable tueuse à gages. Ce trio atypique va devoir composer pour passer inaperçu, tout en découvrant les vraies valeurs d’une famille unie et aimante. (source : manga-news.com)', 2022, 2, 'Spy x Family', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b90ecb9e-c474-4082-88b5-fe887ce715ab', 25, 'https://pictures.betaseries.com/fonds/poster/648c065942c638df29dd902c9ed55767.jpg', true, 'L’elfe Frieren a vaincu le roi des démons aux côtés du groupe mené par le jeune héros Himmel. Après dix années d’efforts, ils ont ramené la paix dans le royaume. Parce qu’elle est une elfe, Frieren peut vivre plus de mille ans. Elle part seule en voyage, promettant à ses amis qu''elle reviendra les voir. Cinquante ans plus tard, Frieren est de retour, elle n''a pas changé, mais ces retrouvailles sont aussi les derniers instants passés avec Himmel, devenu un vieillard qui s’éteint paisiblement sous ses yeux. Attristée de n’avoir pas passé plus de temps à connaître les gens qu’elle aime, elle décide de reprendre son voyage et de partir à la rencontre de nouvelles personnes…', 2023, 1, 'Frieren', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('35d804bd-65ba-40a3-84ad-50ed7b32d59d', 45, 'https://pictures.betaseries.com/fonds/poster/f8ffbdb05dd4a1923ffe5714ed52fde6.jpg', true, '''J''attends le tueur parfait''. Cette phrase, Louise Arbus, éminente prof de psycho-criminologie à l’université, la connait bien. Elle est issue l''un de ses livres à succès. C''est aussi la phrase que l''on peut lire sur le corps d''une victime retrouvée poignardée. Une scène de crime à la mise en scène soignée et spectaculaire qui implique personnellement Louise Arbus. La psycho-criminologue se voit donc contrainte de collaborer avec les flics pour résoudre cette enquête, alors qu''elle s’était promis d’arrêter huit ans auparavant, suite à la condamnation d’un certain Pierre Delaunay...', 2023, 1, 'Master Crimes', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('021e4511-170d-47c9-86ef-c29e1f067567', 41, 'https://pictures.betaseries.com/fonds/poster/c925cefade5417e51356eae48706e3ac.jpg', false, 'A 27 ans, Lucas Hauchard alias Squeezie est le premier vidéaste de France avec plus de 18 millions d’abonnés sur Youtube. Depuis des débuts dans sa chambre d’ado, jusqu’au GP explorer, il est devenu l’icône d’une génération. Son ami et réalisateur Théodore l’a filmé au cours de toutes ses aventures et nous dresse le portrait intime et touchant d’un jeune geek devenu n°1 du pays.', 2024, 1, 'Squeezie : Merci Internet', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('3a69aca6-002e-495d-9fcd-b4a113e74fef', 46, 'https://pictures.betaseries.com/fonds/poster/040a6e409abca728ebbe315fe3464fe9.jpg', true, 'Dans un futur proche, un groupe de femmes se rencontrent par un incroyable concours de circonstances. Elles embarquent pour un voyage palpitant, cherchant à percer le mystère de leur identité et découvrant une déchirante histoire d''amour et de trahison.', 0, 0, 'Orphan Black: Echoes', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b95b145c-c7d0-4196-b7e0-f3bd05b2c2bb', 57, 'https://pictures.betaseries.com/fonds/poster/5b5ff4139d52efba31cec7b6ce462790.jpg', true, 'Portant un nouveau regard sur les légendes arthuriennes, The Winter King suit l''évolution d''Arthur Pendragon, fils paria qui devient un guerrier et un chef légendaire. The Winter King se déroule au 5e siècle, bien avant l''unification de la Grande-Bretagne, dans un pays de factions et de tribus en guerre, dans un monde brutal où les vies étaient souvent éphémères. D''après la trilogie The Warlord Chronicles de Bernard Cornwell (La Saga du roi Arthur).', 2023, 1, 'The Winter King', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('1b970fe1-d77b-4b57-a5aa-14c7cfc75974', 69, 'https://pictures.betaseries.com/fonds/poster/1a0bcee32c15e23dc619d990c0ea8947.jpg', false, 'En plein conflit successoral, un séduisant héritier est exaspéré par une employée dévouée dont le sourire irrésistible lui est insupportable.', 2023, 1, 'L''Empire du sourire', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('93bf138a-a3fb-4495-92fb-2d29fbaed856', 62, 'https://pictures.betaseries.com/fonds/poster/45bba2d1afa083616c4580551dd5db45.jpg', true, 'Imaginez un monde où la course à l’espace n’aurait jamais pris fin. Cette série dramatique suit le parcours d’astronautes de la NASA, héros et superstars de leur époque, et plonge au plus proche des espoirs et des rêves d’une génération.', 2019, 4, 'For All Mankind', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('10a7860d-f83c-4716-94b1-cdd640da0f0c', 71, 'https://pictures.betaseries.com/fonds/poster/4fc9f9f1655583709a304821ab3dc863.jpg', true, 'Dans ce jeu de survie à énigmes présenté par "le diable", les participants mettent leur ingéniosité à l''épreuve pendant une semaine pour espérer remporter le gros lot.', 2023, 1, 'À l''épreuve du diable', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('28a4bf86-04e4-45a0-b5e1-ee58e2808c60', 44, 'https://pictures.betaseries.com/fonds/poster/e19bd1890bb7975ce9aebc7d1550badf.jpg', true, 'Cette fiction d''espionnage ingénieuse suit une équipe dysfonctionnelle d''agents du MI5 - et leur odieux patron, le célèbre Jackson Lamb - qui naviguent dans le monde trouble de l''espionnage pour défendre l''Angleterre contre des forces malfaisantes.', 2022, 3, 'Slow Horses', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('4f0c5762-5fce-40f7-becc-82bf0644bdf1', 50, 'https://pictures.betaseries.com/fonds/poster/3e11218d324a12143c39bff3c0c8e9bd.jpg', false, 'Sur plus d''une décennie, Jeffrey Dahmer a massacré 17 adolescents et jeunes hommes avant son inculpation. Comment a-t-il pu échapper aux forces de l''ordre pendant si longtemps ?', 2022, 1, 'Dahmer - Monstre : L''histoire de Jeffrey Dahmer', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6952e5ed-2ef4-4bb3-915b-29730c9e97a0', 20, 'https://pictures.betaseries.com/fonds/poster/12bfcd34e17cbb86ab10bb23a841b6fb.jpg', false, 'Bienvenue à l''Hôtel Pokémon, une oasis de paix où les Pokémon viennent s''amuser et se détendre. Quel adorable client Haru, la nouvelle réceptionniste, va-t-elle rencontrer en premier ?', 2023, 1, 'La réceptionniste Pokémon', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('9629250d-7145-4194-b4bf-1ba1088154e9', 56, 'https://pictures.betaseries.com/fonds/poster/7f7d6383233e43ac20de74d0c2616a01.jpg', true, 'Pour mener à bien leur enquête sur un cambriolage défiant toute mesure, des agents fédéraux doivent se montrer créatifs.', 2023, 1, 'Le Code du crime', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('99bfa3c0-8e20-41c4-a543-4d288ced91b4', 72, 'https://pictures.betaseries.com/fonds/poster/c75463cd02a6176af2cf74da550a03fc.jpg', true, 'Divers personnages, connus et inconnus, doivent faire face à la résurgence du mal en Terre du Milieu. Des profondeurs des Montagnes de Brume aux forêts majestueuses du Lindon, de l''île des Rois de Númenor aux contrées les plus éloignées du monde, ces royaumes et personnages vont forger un héritage qui demeurera bien après leur disparition.', 2022, 1, 'Le Seigneur des anneaux : Les Anneaux de pouvoir', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('52536b89-082a-4de7-81fa-f29c8b6f9725', 23, 'https://pictures.betaseries.com/fonds/poster/9313928936a093c7873f8b60ba953f7f.jpg', true, 'À l''Est se trouve une terre gouvernée par un empereur, dont les épouses et les femmes au service de l''Etat vivent dans un vaste complexe appelé hougong, le palais arrière. Maomao, une fille modeste élevée par son père apothicaire, n''avait jamais imaginé que l''arrière-palais aurait quelque chose à voir avec elle jusqu''à ce qu''elle soit kidnappée et vendue pour y travailler comme servante.
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('6e0fdd68-1082-4681-becf-e7118f678efc', 24, 'https://pictures.betaseries.com/fonds/poster/26c2dbfc5e2c04f0e9efc71cd5f718e4.jpg', true, 'Dans un futur proche, les jeux s’affichant sur des écrans sont passés de mode. La technologie VR en immersion domine ce marché, mais parmi la multitude de jeux, un grand nombre sont bien souvent nuls et sans intérêt. Certains ont décidé de s’attaquer à ces jeux, comme Rakuro Hizutome, alias Sunraku, qui se plaît à enchaîner les pires d’entre-eux. Mais cette fois, il a décidé de se lancer dans Shangri-La Frontier, un jeu grand public aux quelques trente millions de membres inscrits ! Des amis en ligne, un univers immense, des rencontres avec des rivaux... Rakuro est loin d’imaginer que sa vie, voire son destin et celui de nombreuses personnes, est sur le point de changer lorsqu’il se lance dans cette aventure…', 2023, 1, 'Shangri-La Frontier', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('377f6fe1-dedd-410a-9342-ffb30698b6d3', 49, 'https://pictures.betaseries.com/fonds/poster/af4f5605eff221ee063d6a062ac15503.jpg', true, 'Jeune avocate d’affaires dans un prestigieux cabinet parisien, Roxane voit sa vie bouleversée quand son mari, associé du cabinet, est accusé de viol. Ramenée malgré elle dans la cité de son enfance, elle va tenter de se reconstruire en tant qu’avocate pénaliste au tribunal de Bobigny.', 2023, 1, '66-5', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('63b519c5-c20c-4278-802a-e1880b0496ba', 26, 'https://pictures.betaseries.com/fonds/poster/d257615110d72a03ad476a894f453c86.jpg', true, 'Donjons, dragons... et un bon ragoût de monstre ? Des aventuriers plongent au sein d''un royaume maudit pour sauver leur amie et prouvent leurs talents de cordons-bleus.', 2024, 1, 'Gloutons & Dragons', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('1201ab9e-48d5-4387-baba-9225be4fb9ad', 25, 'https://pictures.betaseries.com/fonds/poster/c5c7105be425d9341397ea9aa5fc055d.jpg', true, 'Charlie Morningstar, la Princesse de l''Enfer, lutte pour convaincre les démons et les anges que n''importe quelle âme peut être rachetée. Venez chanter devant cette comédie musicale animée pour adultes sur la rédemption.', 2024, 1, 'Hôtel Hazbin', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('52fa90d1-8285-49ff-a361-f48247b7c65f', 0, 'https://pictures.betaseries.com/fonds/poster/36b55664a013fd031b76be003701f356.jpg', true, 'En 1600 au Japon, à l’aube d’une guerre civile qui marquera le siècle, John Blackthorne, le commandant anglais d’un mystérieux navire abandonné sur la plage d’un village de pêcheurs voisin, est porteur de secrets qui pourraient faire pencher la balance en faveur du seigneur Yoshii Toranaga, engagé dans une lutte à mort contre ses ennemis du Conseil des régents. Ils réduiraient du même coup l’influence des ennemis de Blackthorne, les prêtres jésuites et commerçants portugais. Les destins de Toranaga et Blackthorne seront inextricablement liés à leur traductrice, Toda Mariko, une mystérieuse chrétienne de noble extraction, dernière d’une lignée tombée en disgrâce. Tout en servant son seigneur dans ce paysage politique tendu, Mariko devra concilier sa relation avec Blackthorne, son engagement envers la foi qui l’a sauvée et le devoir d’une fille envers son défunt père.', 2024, 0, 'Shōgun', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('4fc5756b-9973-457e-b355-597a2225245a', 90, 'https://pictures.betaseries.com/fonds/poster/179f31ad3e0afd0fb0425aa91cd43b6e.jpg', false, 'Rick et Michonne sont plongés dans un autre monde, construit sur les cendres d''une guerre avec les morts. Et en définitive, d''une guerre avec les vivants. Peuvent-ils se retrouver et se rappeler qui ils étaient dans un endroit et une situation différents de tout ce qu''ils ont connu ? Sont-ils ennemis ? Amants ? Victimes ? Victorieux ? Sans l''un et l''autre sont-ils même vivants ou vont-ils découvrir qu''ils sont eux aussi des zombies ?', 2024, 0, 'The Walking Dead: The Ones Who Live', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('147acbe4-e779-4f9e-96ec-ea9728b2de9b', 35, 'https://pictures.betaseries.com/fonds/poster/f6a857386242e30476ecb4c39fb37de7.jpg', true, 'Camila trouve son prince charmant sur une application de rencontres. Après une folle histoire d''amour, elle décide de le surprendre... et se retrouve coincée dans un faux paradis.', 2023, 1, 'Faux profil', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('b6df8ae4-b279-42c5-9571-0de89fecbcb4', 42, 'https://pictures.betaseries.com/fonds/poster/7de1fa80b22c9557f9f9311fd712900b.jpg', false, 'Quatre mois après le tragique accident de voiture qui a tué leurs parents, Elena Gilbert, 17 ans, et son frère Jeremy, 15 ans, essaient encore de s''adapter à cette nouvelle réalité. Belle et populaire, l''adolescente poursuit ses études au Mystic Falls High en s''efforçant de masquer son chagrin. Elena est immédiatement fascinée par Stefan et Damon Salvatore, deux frères que tout oppose. Elle ne tarde pas à découvrir qu''ils sont en fait des vampires...', 2009, 8, 'The Vampire Diaries', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('73928b5d-b01c-4b6c-8905-8e0f34fa6db0', 61, 'https://pictures.betaseries.com/fonds/poster/108852b6931cdad1693175edf7c01446.jpg', true, 'Les super-héros ont mal tourné et abusent de leurs super-pouvoirs et de leur notoriété. Un groupe de justiciers (The Boys) décide de s''attaquer aux super-héros corrompus avec le courage de ceux qui n''ont rien à perdre et sont prêts à tout - y compris aux coups les plus tordus.', 2019, 3, 'The Boys', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('aae5f087-1e25-418d-b7eb-c8796d6f2061', 71, 'https://pictures.betaseries.com/fonds/poster/e25b6a96327c8a776b60fe7dc176b10c.jpg', true, 'Comme leurs semblables se transforment en monstres féroces et sèment la terreur, un ado perturbé et ses voisins d''immeuble se battent pour leur vie... et leur humanité !', 2020, 2, 'Sweet Home', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('bfd5ed9c-df60-4bd4-8eae-940e9bb1196a', 37, 'https://pictures.betaseries.com/fonds/poster/b3a6176589360c04042a4fea0260f487.jpg', true, 'Inspirée des livres à succès de R.L. Stine, la série "Chair de poule" suit les aventures de cinq lycéens qui enquêtent sur le décès tragique, survenu trente ans auparavant, d''un adolescent nommé Harold Biddle. Ce faisant, les adolescents découvrent de sombres secrets sur le passé de leurs propres parents.', 2023, 1, 'Chair de poule (2023)', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('5003b179-23f5-4c8b-bb1e-b2f919c0e335', 0, 'https://pictures.betaseries.com/fonds/poster/8c841b7d4d6983e374402a9d736bd9ea.jpg', false, 'Une décision prise dans la Chine des années 60 se répercute par-delà l''espace et le temps. Des scientifiques du présent doivent alors affronter la pire menace pour l''humanité.', 2024, 0, 'Le Problème à 3 corps', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('c2b15890-a25e-4594-8b68-955be10e70fe', 39, 'https://pictures.betaseries.com/fonds/poster/84b4f44bfab91ff29d43de9d72d21458.jpg', true, 'Il y a huit ans, Citadelle tombait. L''agence d''espionnage mondiale indépendante - chargée de maintenir la sûreté et la sécurité de tous - a été détruite par des agents de Manticore, un puissant syndicat manipulant le monde dans l''ombre. Avec la chute de Citadelle, les agents d''élite Mason Kane et Nadia Sinh ont vu leurs souvenirs effacés alors qu''ils s''échappaient de justesse. Ils sont restés cachés depuis, (re)construisant de nouvelles vies sous de nouvelles identités, ignorant leur passé. Jusqu''à une nuit, lorsque Mason est retrouvé par son ancien collègue de Citadelle, Bernard Orlick, qui a désespérément besoin de son aide pour empêcher Manticore d''établir un nouvel ordre mondial.', 2023, 1, 'Citadelle', 'SHOW');
INSERT INTO public.media (id, duration, image_url, in_prodution, plot, release_year, seasons, title, type) VALUES ('791ea151-6d61-4624-8df8-f8a3936128f2', 47, 'https://pictures.betaseries.com/fonds/poster/ee9d5df5bef9dda157ac6228d820ebfd.jpg', true, 'Renouant avec un père qu''il connaissait à peine, Alphonse, un quadragénaire en pleine déroute professionnelle et conjugale, se découvre une surprenante vocation. Sa trajectoire va alors croiser celle d''une galaxie de femmes plus passionnantes et excentriques les unes que les autres, le plongeant au cœur d''une histoire à la fois périlleuse, transgressive et pleine de tendresse.', 2023, 1, 'Alphonse', 'SHOW');
